(53,	13,	'Warpath',	'Bristleback works himself up into a fury every time he casts a spell, increasing his movement speed and damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/bristleback_warpath.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/bristleback/bristleback_warpath.mp4',	0),
(54,	14,	'Insatiable hunger',	'A violent lust for vital fluids increases Broodmother\'s attack damage and gives her a vampiric attack.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/broodmother_insatiable_hunger.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/broodmother/broodmother_insatiable_hunger.mp4',	1),
(55,	14,	'Spin web',	'Spins a large web that grants Broodmother a passive movement speed increase, gives free movement, and boosts regeneration while in its vicinity. Spin Web charges restore every %charge_restore_time% seconds. Spin Web can be cast from anywhere as long as the new web touches an existing web. Webs never expire, and can be manually destroyed. When the maximum limit of webs is exceeded, the oldest web disappears.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/broodmother_spin_web.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/broodmother/broodmother_spin_web.mp4',	2),
(56,	14,	'Silken bola',	'Slows the target enemy, causes them to miss and deals impact damage. Units that attack the target deal bonus magic damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/broodmother_silken_bola.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/broodmother/broodmother_silken_bola.mp4',	3),
(57,	14,	'Spawn spiderlings',	'Broodmother injects her young into an enemy unit, dealing damage. The spiderlings will hatch if the target is killed while under this influence.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/broodmother_spawn_spiderlings.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/broodmother/broodmother_spawn_spiderlings.mp4',	0),
(58,	15,	'Hoof stomp',	'Slams the ground, stunning and damaging nearby enemy units.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/centaur_hoof_stomp.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/centaur/centaur_hoof_stomp.mp4',	1),
(59,	15,	'Double edge',	'Centaur strikes a mighty blow at melee range, damaging both himself and a small area around the target. Deals extra damage based on your strength. Centaur cannot die from Double Edge.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/centaur_double_edge.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/centaur/centaur_double_edge.mp4',	2),
(60,	15,	'Retaliate',	'Centaur counters all attacks, dealing damage back to the attacker. Returns a fixed amount plus a percentage of your strength. Deals half damage to towers.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/centaur_return.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/centaur/centaur_return.mp4',	3),
(61,	15,	'Stampede',	'Centaur leads all allies into a vicious charge causing them to move through units at max speed and stop any enemy units they trample. Trampled enemies take damage based on Centaur Warrunner\'s strength. Each enemy can be trampled once.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/centaur_stampede.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/centaur/centaur_stampede.mp4',	0),
