(65,	16,	'Phantasm',	'Summons several phantasmal copies of the Chaos Knight from alternate dimensions. The phantasms are strong illusions that deal 100% damage, but take 325% damage.\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/chaos_knight_phantasm.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/chaos_knight/chaos_knight_phantasm.mp4',	0),
