(67,	17,	'Holy persuasion',	'Chen takes control of an enemy or neutral creep. If the persuaded creep\'s base health is naturally below the health minimum, its base health will be raised to the health minimum. Converted creeps will have increased movement speed and bonus damage. \r\n\r\nCan be cast on converted creeps to teleport them to Chen. If cast on Chen, all units controlled by Chen will be teleported to him. Taking damage will dispel the buff.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/chen_holy_persuasion.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/chen/chen_holy_persuasion.mp4',	2),
(68,	17,	'Divine favor',	'Passively provides an aura that grants increased health regeneration and amplifies all health restore by a percentage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/chen_divine_favor.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/chen/chen_divine_favor.mp4',	3),
(69,	17,	'Hand of god',	'Heals all allied heroes on the map as well as all units under Chen\'s control.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/chen_hand_of_god.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/chen/chen_hand_of_god.mp4',	0),
(70,	18,	'Strafe',	'Clinkz nimbly attacks with a barrage of arrows. Gains 100% evasion from ranged attackers and dramatically increases attack speed for a short time.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/clinkz_strafe.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/clinkz/clinkz_strafe.mp4',	1),
