(73,	18,	'Death pact',	'Clinkz consumes the target enemy unit or friendly unit, gaining max health and damage based on its current health.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/clinkz_death_pact.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/clinkz/clinkz_death_pact.mp4',	0),
(74,	19,	'Battery assault',	'Discharges high-powered shrapnel at random nearby enemy units, dealing minor magical damage and ministun.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/rattletrap_battery_assault.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/rattletrap/rattletrap_battery_assault.mp4',	1),
(75,	19,	'Power cogs',	'Forms a barrier of energized cogs around Clockwerk, trapping any units that are near.  Enemies outside the trap that touch a cog are knocked back, losing health and mana. Once a cog has delivered a shock, it will power down.  Cogs can be destroyed by enemy attacks, but Clockwerk can destroy them with just one.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/rattletrap_power_cogs.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/rattletrap/rattletrap_power_cogs.mp4',	2),
(76,	19,	'Rocket flare',	'Fires a global range flare that explodes over a given area, damaging enemies and providing vision for 6.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/rattletrap_rocket_flare.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/rattletrap/rattletrap_rocket_flare.mp4',	3),
(77,	19,	'Hookshot',	'Fires a grappling device rapidly at the target location.  If the hook hits a unit, Clockwerk launches himself into the target, stunning and dealing damage.  Any enemies Clockwerk collides with along the way are damaged and stunned.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/rattletrap_hookshot.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/rattletrap/rattletrap_hookshot.mp4',	0),
