(79,	20,	'Frostbite',	'Encases an enemy unit in ice, prohibiting movement and attack, while dealing damage over time. Lasts 10.0 seconds on creeps level 6 or lower.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/crystal_maiden_frostbite.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/crystal_maiden/crystal_maiden_frostbite.mp4',	2),
(80,	20,	'Arcane aura',	'Gives additional mana regeneration to all friendly units on the map. This bonus is increased for Crystal Maiden.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/crystal_maiden_brilliance_aura.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/crystal_maiden/crystal_maiden_brilliance_aura.mp4',	3),
(81,	20,	'Freezing field',	'CHANNELED - Surrounds Crystal Maiden with random icy explosions that slow enemies and deal massive damage. Grants bonus armor while channeling. Lasts 10.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/crystal_maiden_freezing_field.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/crystal_maiden/crystal_maiden_freezing_field.mp4',	0),
(82,	22,	'Bramble maze',	'Dark Willow creates a maze of brambles that grow in the target area after 0.5 seconds.  Enemies that walk into a bramble are rooted and take damage over time.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dark_willow_bramble_maze.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dark_willow/dark_willow_bramble_maze.mp4',	1),
