(84,	22,	'Cursed crown',	'Dark Willow casts an ancient fae curse on the target. After a delay, the target and nearby enemies are stunned.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dark_willow_cursed_crown.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dark_willow/dark_willow_cursed_crown.mp4',	3),
(85,	22,	'Bedlam',	'Dark Willow\'s pet wisp roams around her for the duration, rapidly attacking nearby enemies.  Bedlam cannot be used while Terrorize is active.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dark_willow_bedlam.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dark_willow/dark_willow_bedlam.mp4',	0),
(86,	22,	'Terrorize',	'Dark Willow releases her pet wisp to terrorize her enemies. After a short delay, all enemies in the target area become fearful and run toward their home fountain. Terrorize cannot be used while Bedlam is active.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dark_willow_terrorize.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dark_willow/dark_willow_terrorize.mp4',	0),
(87,	23,	'Starbreaker',	'Dawnbreaker whirls her hammer around 3 times, damaging enemies with her attack plus bonus damage. On the final strike, she smashes her hammer down, stunning and damaging enemies in front of her.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dawnbreaker_fire_wreath.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dawnbreaker/dawnbreaker_fire_wreath.mp4',	1),
(88,	23,	'Celestial hammer',	'Dawnbreaker hurls her weapon at a target, damaging enemies struck along the way. The hammer pauses for 2.0 seconds at the destination before flying back to her, leaving a trail of fire that slows enemies. Dawnbreaker can recall the hammer at any time, pulling her towards it so they meet in the middle.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dawnbreaker_celestial_hammer.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dawnbreaker/dawnbreaker_celestial_hammer.mp4',	2),
(89,	23,	'Luminosity',	'After 3 attacks, Dawnbreaker powers up, charging her next attack with a critical hit that heals all allied heroes within 650 units around her for a portion of attack damage dealt. Creeps and neutral enemies provide less healing. Allies are healed for 35% of the amount.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dawnbreaker_luminosity.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dawnbreaker/dawnbreaker_luminosity.mp4',	3),
(90,	23,	'Solar guardian',	'Dawnbreaker creates a pulsing effect at a location within 350 units of an allied hero anywhere on the map, damaging enemies and healing allies with each pulse. After a short duration, she flies to the target location, dealing additional damage and stunning enemies upon landing. Once channeled, Dawnbreaker cannot stop the ability.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dawnbreaker_solar_guardian.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dawnbreaker/dawnbreaker_solar_guardian.mp4',	0),
(91,	24,	'Poison touch',	'Releases a cone of poison that strikes multiple enemy units. Deals damage over time and slows the targets. Anytime the targets get attacked, the debuff duration is refreshed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dazzle_poison_touch.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dazzle/dazzle_poison_touch.mp4',	1),
(92,	24,	'Shallow grave',	'An ally blessed with Shallow Grave, no matter how close to death, cannot die while under its protection.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dazzle_shallow_grave.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dazzle/dazzle_shallow_grave.mp4',	2),
(93,	24,	'Shadow wave',	'Sends out a bolt of power that arcs between allies, healing them while damaging any units standing nearby.  Dazzle is always healed by Shadow Wave.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dazzle_shadow_wave.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dazzle/dazzle_shadow_wave.mp4',	3),
(94,	24,	'Bad juju',	'Passively reduces cooldowns on Dazzle\'s abilities and items. Anytime he casts a spell, all nearby enemies will have their armor reduced. Debuff stacks and refreshes duration.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dazzle_bad_juju.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dazzle/dazzle_bad_juju.mp4',	0),
(95,	25,	'Crypt swarm',	'Sends a swarm of winged beasts to savage enemy units in front of Death Prophet.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/death_prophet_carrion_swarm.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/death_prophet/death_prophet_carrion_swarm.mp4',	1),
(96,	25,	'Silence',	'Prevents enemy units in a target area from casting spells.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/death_prophet_silence.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/death_prophet/death_prophet_silence.mp4',	2),
(97,	25,	'Spirit siphon',	'Creates a spirit link between Death Prophet and an enemy unit, draining 14.0 + 1.0% Max HP per second from the enemy.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/death_prophet_spirit_siphon.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/death_prophet/death_prophet_spirit_siphon.mp4',	3),
(98,	25,	'Exorcism',	'Unleashes evil spirits to drain the life of nearby enemy units and structures. At the end of the spell\'s duration, Death Prophet is healed in proportion to the damage dealt. Lasts 35.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/death_prophet_exorcism.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/death_prophet/death_prophet_exorcism.mp4',	0),
(99,	26,	'Thunder strike',	'Repeatedly strikes the targeted unit with lightning.  Each strike damages nearby enemy units in a small radius and slows enemy movement and attack speed by 100% for 0.1 seconds.  Provides vision of its target.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/disruptor_thunder_strike.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/disruptor/disruptor_thunder_strike.mp4',	1),
(100,	26,	'Glimpse',	'Teleports the target hero back to where it was 4 seconds ago.  Instantly kills illusions.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/disruptor_glimpse.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/disruptor/disruptor_glimpse.mp4',	2),
(101,	26,	'Kinetic field',	'After a short formation time, creates a circular barrier of kinetic energy that enemies can\'t pass.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/disruptor_kinetic_field.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/disruptor/disruptor_kinetic_field.mp4',	3),
(102,	26,	'Static storm',	'Creates a damaging static storm that also silences all enemy units in the area for the duration.  The damage starts off weak, but increases in power over the duration.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/disruptor_static_storm.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/disruptor/disruptor_static_storm.mp4',	0),
(103,	27,	'Devour',	'Consumes an enemy or neutral creep, acquiring any special abilities that it possessed. If autocast is deactivated, Doom will not acquire the creep\'s abilities. Duration is equal to the cooldown.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/doom_bringer_devour.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/doom_bringer/doom_bringer_devour.mp4',	1),
(104,	27,	'Scorched earth',	'Carpets the nearby earth in flames which damage enemies, while also granting him increased movement speed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/doom_bringer_scorched_earth.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/doom_bringer/doom_bringer_scorched_earth.mp4',	2),
(105,	27,	'Infernal blade',	'Doom swings his burning sword, igniting the enemy. Stuns for 0.6 seconds and applies a 4.0 second burn that deals a base damage plus a percentage of the target\'s Max HP as damage per second.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/doom_bringer_infernal_blade.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/doom_bringer/doom_bringer_infernal_blade.mp4',	3),
(106,	27,	'Doom',	'Inflicts a curse that dispels an enemy Hero and prevents an them from casting spells or using items, while taking damage over time.\r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/doom_bringer_doom.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/doom_bringer/doom_bringer_doom.mp4',	0),
(107,	28,	'Breathe fire',	'Unleashes a breath of fire in front of Dragon Knight that burns enemies and reduces the damage their attacks deal.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dragon_knight_breathe_fire.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dragon_knight/dragon_knight_breathe_fire.mp4',	1),
(108,	28,	'Dragon tail',	'Dragon Knight smites an enemy unit in melee range with his shield, stunning it while dealing minor damage.  When in Elder Dragon Form, the cast range increases to 400.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dragon_knight_dragon_tail.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dragon_knight/dragon_knight_dragon_tail.mp4',	2),
(109,	28,	'Dragon blood',	'The life blood of the Dragon improves health regeneration and strengthens armor.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dragon_knight_dragon_blood.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dragon_knight/dragon_knight_dragon_blood.mp4',	3),
(110,	28,	'Elder dragon form',	'Dragon Knight takes the form of one of three powerful elder dragons, increasing his speed, and Dragon Tail\'s range, while granting him new powers. LEVEL 1 Green Dragon - Corrosive Breath: attacks deal 20 poison damage per second for 5.0 seconds. Works on structures. LEVEL 2 Red Dragon - Splash Attack: attacks damage all enemy units in a 350 radius for 75% damage, with Corrosive Breath added to the targets. LEVEL 3 Blue Dragon - Frost Breath: slows movement speed by -40% and attack speed by -40 of enemy units in Splash Attack range for 3.0 seconds, with Corrosive Breath added to the targets.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/dragon_knight_elder_dragon_form.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/dragon_knight/dragon_knight_elder_dragon_form.mp4',	0),
(111,	29,	'Frost arrows',	'Adds a freezing effect to Drow\'s attacks, slowing enemy movement and dealing bonus damage.  Slow lasts 1.5 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/drow_ranger_frost_arrows.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/drow_ranger/drow_ranger_frost_arrows.mp4',	1),
(112,	29,	'Gust',	'Releases a wave that silences and knocks back enemy units. Knockback distance is relative to how close they are to Drow.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/drow_ranger_wave_of_silence.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/drow_ranger/drow_ranger_wave_of_silence.mp4',	2),
(113,	29,	'Multishot',	'Channeling. Drow releases a flurry of arrows in continuous salvos, hitting enemies for extra damage and applying longer duration Frost Arrows. Lasts up to 1.8 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/drow_ranger_multishot.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/drow_ranger/drow_ranger_multishot.mp4',	3),
(114,	29,	'Marksmanship',	'Drow\'s experiences in battle grant her a chance to launch arrows with incredible accuracy and effectiveness. Pierces through the enemy\'s defenses, ignoring their base armor. Grants Drow and nearby ranged heroes with bonus agility based on Drow\'s current agility. This ability is disabled if there is an enemy hero within 400 range.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/drow_ranger_marksmanship.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/drow_ranger/drow_ranger_marksmanship.mp4',	0),
(115,	30,	'Boulder smash',	'Earth Spirit smashes the target enemy or ally, sending them in the direction he is facing. If Earth Spirit targets an area, he will smash the nearest Stone Remnant in a 200 radius. The travelling unit or Remnant damages all enemy units it hits.  If an enemy is hit by a Stone Remnant, they are also slowed. Stone Remnants travel further than other units.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/earth_spirit_boulder_smash.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/earth_spirit/earth_spirit_boulder_smash.mp4',	1),
(116,	30,	'Rolling boulder',	'Earth Spirit gathers himself into a boulder and, after a 0.6s delay, rolls toward the target location, damaging and stunning enemy units. He will stop if he collides with an enemy hero or is stunned. If he rolls over a Stone Remnant, he will travel further and faster, and stun enemies for longer.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/earth_spirit_rolling_boulder.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/earth_spirit/earth_spirit_rolling_boulder.mp4',	2),
(117,	30,	'Geomagnetic grip',	'Earth Spirit pulls the target Stone Remnant. Enemies struck by the gripped target will be silenced and take damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/earth_spirit_geomagnetic_grip.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/earth_spirit/earth_spirit_geomagnetic_grip.mp4',	3),
(118,	30,	'Stone remnant',	'Call a Stone Remnant to the target location.  Stone Remnants have no vision and are invulnerable, and can be used with Earth Spirit\'s abilities.  Calling a Stone Remnant consumes a charge, which recharge over time.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/earth_spirit_stone_caller.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/earth_spirit/earth_spirit_stone_caller.mp4',	4),
(119,	30,	'Magnetize',	'Magnetizes units in a small nearby area, causing them to take damage for a short duration. Magnetized heroes cause nearby Stone Remnants to explode, destroying the remnant and refreshing Magnetize\'s duration on all nearby enemies. This process can repeat multiple times. If an enemy hero is affected by Geomagnetic Grip or Boulder Smash, all magnetized heroes share the effects.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/earth_spirit_magnetize.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/earth_spirit/earth_spirit_magnetize.mp4',	0),
(120,	31,	'Fissure',	'Slams the ground with a mighty totem, creating an impassable ridge of stone while stunning and damaging enemy units along its line.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/earthshaker_fissure.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/earthshaker/earthshaker_fissure.mp4',	1),
(121,	31,	'Enchant totem',	'Empowers Earthshaker\'s totem, causing it to deal extra damage and have 75 bonus attack range on the next attack.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/earthshaker_enchant_totem.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/earthshaker/earthshaker_enchant_totem.mp4',	2),
(122,	31,	'Aftershock',	'Causes the earth to shake underfoot, adding additional damage and stuns to nearby enemy units when Earthshaker casts his abilities.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/earthshaker_aftershock.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/earthshaker/earthshaker_aftershock.mp4',	3),
(123,	31,	'Echo slam',	'Shockwaves travel through the ground, damaging enemy units.  Each enemy hit causes an echo to damage nearby units. Real heroes cause two echoes.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/earthshaker_echo_slam.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/earthshaker/earthshaker_echo_slam.mp4',	0),
(124,	32,	'Echo stomp',	'Elder Titan and his Astral Spirit both stomp the ground, damaging and knocking nearby enemy units unconscious around their locations.  The Elder Titan stomp deals physical damage, while the Spirit stomp deals magical damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/elder_titan_echo_stomp.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/elder_titan/elder_titan_echo_stomp.mp4',	1),
(125,	32,	'Astral spirit',	'Elder Titan sends forth his Astral Spirit, damaging any units it passes through.  When the spirit rejoins the Titan, it grants bonus damage and movement speed for each unit it passed through.\r\n\r\nThe Astral Spirit can be controlled and possesses the Echo Stomp, Return Spirit, and Natural Order abilities.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/elder_titan_ancestral_spirit.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/elder_titan/elder_titan_ancestral_spirit.mp4',	2),
(126,	32,	'Natural order',	'Reduces all elements to their basic levels, removing base armor and magic damage resistance from nearby enemy units. The armor reduction is centered around the hero, while the magic armor reduction is centered around Astral Spirit.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/elder_titan_natural_order.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/elder_titan/elder_titan_natural_order.mp4',	3),
(127,	32,	'Earth splitter',	'Sends forth a jagged crack in front of Elder Titan. After 3 seconds, the crack implodes, slowing movement while dealing damage to each enemy based on their maximum life. Half of the damage dealt is Magical damage, while the other half is Physical damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/elder_titan_earth_splitter.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/elder_titan/elder_titan_earth_splitter.mp4',	0),
(128,	33,	'Searing chains',	'Ember Spirit unleashes fiery bolas that wrap around nearby enemies, anchoring them in place and dealing damage each second.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ember_spirit_searing_chains.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ember_spirit/ember_spirit_searing_chains.mp4',	1),
(129,	33,	'Sleight of fist',	'Ember Spirit dashes around with blazing speed, attacking all enemies in the targeted area of effect, then returning to his start location.  Deals bonus damage to heroes, and less damage to creeps.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ember_spirit_sleight_of_fist.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ember_spirit/ember_spirit_sleight_of_fist.mp4',	2),
(130,	33,	'Flame guard',	'Ember Spirit surrounds himself with a ring of fire that consumes incoming magic damage, leaving him unharmed.  Flame Guard deals damage per second in an area around Ember Spirit while Flame Guard is active.  If the shield is broken, the damage is also lost.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ember_spirit_flame_guard.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ember_spirit/ember_spirit_flame_guard.mp4',	3),
(131,	33,	'Activate fire remnant',	'Select the Fire Remnant to arrive at.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ember_spirit_activate_fire_remnant.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ember_spirit/ember_spirit_activate_fire_remnant.mp4',	0),
(132,	33,	'Fire remnant',	'Ember Spirit generates Fire Remnant charges every %charge_restore_time% seconds, with a max of %max_charges% charges. Releasing a charge sends a Fire Remnant that runs to the target location at 250% Ember Spirit\'s speed.  Using Activate Fire Remnant, Ember Spirit can dash out to his Remnants, dealing damage along the way and exploding them upon arrival.  The targeted Remnant will be arrived at last.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ember_spirit_fire_remnant.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ember_spirit/ember_spirit_fire_remnant.mp4',	0),
(133,	34,	'Impetus',	'Places an enchantment on each attack while activated, causing it to deal additional damage based on how far away the target is.  The farther the target, the greater the damage dealt.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/enchantress_impetus.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/enchantress/enchantress_impetus.mp4',	1),
(134,	34,	'Enchant',	'Enchantress charms an enemy. If the enemy is a hero, they are slowed. If the enemy is a creep, she brings it under her control, increasing it\'s attack damage and max health.\r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/enchantress_enchant.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/enchantress/enchantress_enchant.mp4',	2),
(135,	34,	'Nature\'s attendants',	'A cloud of wisps heals Enchantress and any friendly units nearby. Lasts 12.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/enchantress_natures_attendants.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/enchantress/enchantress_natures_attendants.mp4',	3),
(136,	34,	'Untouchable',	'Enchantress beguiles her enemies, slowing their attacks when she is attacked.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/enchantress_untouchable.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/enchantress/enchantress_untouchable.mp4',	0),
(137,	35,	'Malefice',	'Focuses Enigma\'s power on a target, causing it to take damage and become repeatedly stunned for multiple instances.  An instance strikes every 2.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/enigma_malefice.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/enigma/enigma_malefice.mp4',	1),
(138,	35,	'Demonic conversion',	'Transforms a creep into three fragments of Enigma himself.  These eidolons are all under Enigma\'s control, and repeated successful attacks cause them to multiply.  When this happens, the eidolons have their health restored.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/enigma_demonic_conversion.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/enigma/enigma_demonic_conversion.mp4',	2),
(139,	35,	'Midnight pulse',	'Steeps an area in dark resonance, damaging enemy units based on their max HP.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/enigma_midnight_pulse.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/enigma/enigma_midnight_pulse.mp4',	3),
(140,	35,	'Black hole',	'CHANNELED - Summons a vortex that sucks in nearby enemy units.  Enemies affected by Black Hole cannot move, attack, or cast spells.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/enigma_black_hole.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/enigma/enigma_black_hole.mp4',	0),
(141,	36,	'Time walk',	'Rushes to a target location while backtracking any damage taken the last 2.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/faceless_void_time_walk.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/faceless_void/faceless_void_time_walk.mp4',	1),
(142,	36,	'Time dilation',	'Faceless Void traps all nearby enemies in a time dilation field for 8.0 seconds, extending their cooldowns and slowing their movement and attack speed by 10% for each cooldown extended. Deals damage per second for each cooldown.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/faceless_void_time_dilation.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/faceless_void/faceless_void_time_dilation.mp4',	2),
(143,	36,	'Time lock',	'Adds the chance for an attack to lock an enemy unit in time while attacking it a second time.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/faceless_void_time_lock.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/faceless_void/faceless_void_time_lock.mp4',	3),
(144,	36,	'Chronosphere',	'Creates a blister in spacetime, trapping all units caught in its sphere of influence and causes you to move very quickly inside it.  Only Faceless Void and any units he controls are unaffected.  Invisible enemies in the sphere will be revealed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/faceless_void_chronosphere.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/faceless_void/faceless_void_chronosphere.mp4',	0),
(145,	37,	'Stroke of fate',	'Grimstroke paints a path of ink with his brush, damaging and slowing enemies. The damage is increased with each enemy the ink hits.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/grimstroke_dark_artistry.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/grimstroke/grimstroke_dark_artistry.mp4',	1),
(146,	37,	'Phantom\'s embrace',	'Summons a phantom that moves quickly towards the target, latching to it when she arrives. Once latched, the phantom damages and silences. If she survives the full latch duration she rends her victim for heavy damage and refreshes Phantom\'s Embrace\'s cooldown.\r\n\r\nHero attacks against the phantom count as 3 attacks each.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/grimstroke_ink_creature.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/grimstroke/grimstroke_ink_creature.mp4',	2),
(147,	37,	'Ink swell',	'Grimstroke shrouds an allied unit in ink, increasing its movement speed. Enemies in range of the allied unit are damaged with inky tendrils over time. After 3.0 seconds it triggers, applying damage and stun in an area around the unit in proportion to how long ink tendril was near any hero.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/grimstroke_spirit_walk.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/grimstroke/grimstroke_spirit_walk.mp4',	3),
(148,	37,	'Soulbind',	'Binds a targeted enemy hero to its nearest allied hero within the bind radius, preventing both from moving away from each other. Any unit-targeted ability that either bound hero receives also gets cast on the other hero. If the bind is broken before the duration expires, the initial target will be bound to its nearest allied hero in the radius.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/grimstroke_soul_chain.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/grimstroke/grimstroke_soul_chain.mp4',	0),
(149,	38,	'Rocket barrage',	'Launches a salvo of rockets at nearby enemy units in a radius around the Gyrocopter.  Lasts 3.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/gyrocopter_rocket_barrage.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/gyrocopter/gyrocopter_rocket_barrage.mp4',	1),
(150,	38,	'Homing missile',	'Fires a homing missile to seek the targeted enemy unit. The missile gains speed over time, dealing damage and stunning when it impacts the target. Enemy units can destroy the missile before it reaches its target.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/gyrocopter_homing_missile.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/gyrocopter/gyrocopter_homing_missile.mp4',	2),
(151,	38,	'Flak cannon',	'Gyrocopter\'s attacks hit all enemy units in an area around it for a limited number of attacks.  Only the main target of attacks will receive attack bonuses such as Critical Strike.  Lasts 10.0 seconds or until the attacks are used.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/gyrocopter_flak_cannon.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/gyrocopter/gyrocopter_flak_cannon.mp4',	3),
(152,	38,	'Call down',	'Call down an aerial missile strike on enemy units in a target area. After 2 seconds, two missiles arrive in succession, with 2 seconds between them.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/gyrocopter_call_down.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/gyrocopter/gyrocopter_call_down.mp4',	0),
(153,	39,	'Acorn shot',	'Fires Hoodwink\'s attack with an acorn at the target unit.  The acorn bounces to nearby targets, slowing them and dealing a percentage of Hoodwink\'s attack with bonus damage.\r\nIf point targeted, a tree is created at the target position and the acorn will bounce to nearby targets.  The ability may be placed on auto-cast to force this behavior.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/hoodwink_acorn_shot.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/hoodwink/hoodwink_acorn_shot.mp4',	1),
(154,	39,	'Bushwhack',	'Tosses a net trap that stuns enemy heroes if they are near a tree in the area.  Affected enemies take damage and are pulled towards the tree nearest to them, and have their vision reduced to 0 for the duration of the stun.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/hoodwink_bushwhack.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/hoodwink/hoodwink_bushwhack.mp4',	2),
(155,	39,	'Scurry',	'Hoodwink passively has a chance to evade physical attacks while near trees.  When activated, Hoodwink gains bonus movement speed, phased collision, and tree-walking for a brief time.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/hoodwink_scurry.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/hoodwink/hoodwink_scurry.mp4',	3),
(156,	39,	'Sharpshooter',	'Hoodwink charges up and fires a deadly bolt from her crossbow, dealing heavy damage and slow to an enemy Hero.  The damage and debuff duration scale up to max after 3.0 seconds, and the bolt is fired automatically after 5.0 seconds.\r\nHoodwink is knocked backwards for a distance of 350 from the force of the shot.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/hoodwink_sharpshooter.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/hoodwink/hoodwink_sharpshooter.mp4',	0),
(157,	40,	'Inner fire',	'In a fiery rage, knocks all nearby enemies away from you to a fixed distance, dealing damage and disarming them.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/huskar_inner_fire.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/huskar/huskar_inner_fire.mp4',	1),
(158,	40,	'Burning spear',	'Huskar sets his spears aflame, dealing damage over time with his regular attack.  Multiple attacks will stack additional damage.  Each attack drains some of Huskar\'s health.  Lasts 8.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/huskar_burning_spear.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/huskar/huskar_burning_spear.mp4',	2),
(159,	40,	'Berserker\'s blood',	'Huskar\'s injuries feed his power, giving increased attack speed and health regen based on missing health. Health regen is a percentage of your strength.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/huskar_berserkers_blood.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/huskar/huskar_berserkers_blood.mp4',	3),
(160,	40,	'Life break',	'Huskar draws upon his health to break an enemy\'s life, leaping at a target within attack range to shatter a percentage of that hero\'s current health, and slowing them.  While leaping, Huskar is Spell Immune.\r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/huskar_life_break.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/huskar/huskar_life_break.mp4',	0),
(161,	41,	'Quas',	'Allows manipulation of ice elements. Each Quas instance provides increased health regeneration.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_quas.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_quas.mp4',	1),
(162,	41,	'Wex',	'Allows manipulation of storm elements. Each Wex instance provides increased attack speed and movement speed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_wex.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_wex.mp4',	2),
(163,	41,	'Exort',	'Allows manipulation of fire elements. Each Exort instance provides increased attack damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_exort.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_exort.mp4',	3),
(164,	41,	'Invoke',	'Combines the properties of the elements currently being manipulated to create a new spell for Invoker to use. Invoke cooldown is reduced by 0.3 seconds for each orb level. <span><br><span><br> Click the help button to see the list of possible spells.</span></span>',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_invoke.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_invoke.mp4',	0),
(165,	42,	'Tether',	'Tethers Io to an allied unit, granting bonus movement speed to both. When Io restores health or mana, tethered units target gains a larger portion of that amount. The tether breaks when the allied unit moves too far away, or Io cancels the tether.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/wisp_tether.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/wisp/wisp_tether.mp4',	1),
(166,	42,	'Spirits',	'Summon five particle spirits that dance in a circle around Io. If a particle collides with an enemy hero, it explodes, damaging all enemy units in an area around it.  Creeps take minor damage from touching a particle spirit, but do not cause them to explode.  When its duration ends, any remaining Spirits explode.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/wisp_spirits.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/wisp/wisp_spirits.mp4',	2),
(167,	42,	'Overcharge',	'Io gains bonus attack speed, spell amplification, and HP Regen based on max health.  If Io is Tethered to an ally, that unit also gains the bonuses.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/wisp_overcharge.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/wisp/wisp_overcharge.mp4',	3),
(168,	42,	'Spirits movement',	'Sends the spirits closer to you. Can be toggled on and off.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/wisp_spirits_in.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/wisp/wisp_spirits_in.mp4',	2),
(169,	42,	'Spirits out',	'Sends the spirits farther away from you. Can be toggled on and off.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/wisp_spirits_out.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/wisp/wisp_spirits_out.mp4',	2),
(170,	42,	'Relocate',	'Teleports Io and any tethered ally to any location. After the spell expires Io and any tethered ally will return to their original location. Double-click to teleport to your team\'s base fountain.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/wisp_relocate.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/wisp/wisp_relocate.mp4',	0),
(171,	43,	'Dual breath',	'An icy blast followed by a wave of fire launches out in a path in front of Jakiro. The ice slows enemies, while the fire delivers damage over time.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/jakiro_dual_breath.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/jakiro/jakiro_dual_breath.mp4',	1),
(172,	43,	'Ice path',	'Creates a path of ice that stuns and damages enemies that touch it.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/jakiro_ice_path.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/jakiro/jakiro_ice_path.mp4',	2),
(173,	43,	'Liquid fire',	'Jakiro burns his enemies in an area of effect with fire added to his attack, while slowing their attacks.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/jakiro_liquid_fire.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/jakiro/jakiro_liquid_fire.mp4',	3),
(174,	43,	'Macropyre',	'Jakiro exhales a wide line of lasting flames, which deals damage per second to any enemy units caught in the fire.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/jakiro_macropyre.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/jakiro/jakiro_macropyre.mp4',	0),
(175,	44,	'Blade fury',	'Causes a bladestorm of destructive force around Juggernaut, rendering him immune to magic and dealing damage to nearby enemy units. \r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/juggernaut_blade_fury.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/juggernaut/juggernaut_blade_fury.mp4',	1),
(176,	44,	'Healing ward',	'Summons a Healing Ward which heals all nearby allied units, based on their max health.  The Healing Ward moves at 350 movement speed after being summoned.  Lasts 25.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/juggernaut_healing_ward.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/juggernaut/juggernaut_healing_ward.mp4',	2),
(177,	44,	'Blade dance',	'Gives Juggernaut a chance to deal critical damage on each attack.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/juggernaut_blade_dance.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/juggernaut/juggernaut_blade_dance.mp4',	3),
(178,	44,	'Omnislash',	'Juggernaut leaps towards the target enemy units, and then slashes the target and other nearby enemy units at an increased attack rate. Juggernaut is invulnerable for the duration.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/juggernaut_omni_slash.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/juggernaut/juggernaut_omni_slash.mp4',	0),
(179,	45,	'Illuminate',	'Channels light energy, building power the longer it\'s channeled.  Once released, a wave is sent forth that deals damage and gives vision in its path.  The longer it is channeled, the more damage is dealt.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/keeper_of_the_light_illuminate.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/keeper_of_the_light/keeper_of_the_light_illuminate.mp4',	1),
(180,	45,	'Solar bind',	'Weakens an enemy\'s magical resistance, and applies a slow that increases in strength the more the target moves.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/keeper_of_the_light_radiant_bind.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/keeper_of_the_light/keeper_of_the_light_radiant_bind.mp4',	2),
(181,	45,	'Chakra magic',	'Restores mana to the target unit and reduces cooldowns of all abilities currently on cooldown by a fixed amount.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/keeper_of_the_light_chakra_magic.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/keeper_of_the_light/keeper_of_the_light_chakra_magic.mp4',	3),
(182,	45,	'Blinding light',	'A blinding light flashes over the targeted area, knocking back and blinding the units in the area, causing them to miss some attacks. Knockback is 400.0 range over 0.4 seconds,',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/keeper_of_the_light_blinding_light.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/keeper_of_the_light/keeper_of_the_light_blinding_light.mp4',	4),
(183,	45,	'Spirit form',	'Ezalor temporarily turns his body luminescent, gaining bonus movement speed, cast range, grants the Blinding Light ability, and allows Illuminate to be channeled by a separate spirit and heal allies during the day.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/keeper_of_the_light_spirit_form.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/keeper_of_the_light/keeper_of_the_light_spirit_form.mp4',	0),
(184,	45,	'Illuminate',	'Channels light energy, building power the longer it\'s channeled.  Once released, a wave is sent forth that deals damage and gives vision in its path.  The longer it is channeled, the more damage is dealt.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/keeper_of_the_light_spirit_form_illuminate.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/keeper_of_the_light/keeper_of_the_light_spirit_form_illuminate.mp4',	1),
(185,	46,	'Torrent',	'Summons a rising torrent that, after a short delay, hurls enemy units into the sky, stunning, dealing damage and slowing movement speed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/kunkka_torrent.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/kunkka/kunkka_torrent.mp4',	1),
(186,	46,	'Tidebringer',	'Kunkka\'s legendary sword grants increased damage and cleaves a large area of effect in front of him for a single strike.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/kunkka_tidebringer.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/kunkka/kunkka_tidebringer.mp4',	2),
(187,	46,	'X marks the spot',	'Targets a friendly or enemy Hero, marks their position with an X, and returns them to it after several seconds.  Kunkka can trigger the return at any time during the duration. Lasts twice as long on allied heroes.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/kunkka_x_marks_the_spot.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/kunkka/kunkka_x_marks_the_spot.mp4',	3),
(188,	46,	'Ghostship',	'Summons a ghostly ship that sails through the battle before smashing apart, damaging and stunning all enemies caught near the wreckage. Allied heroes touched by the Ghostship are given a swig of The Admiral\'s Rum, receiving bonus movement speed and a delayed reaction to incoming damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/kunkka_ghostship.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/kunkka/kunkka_ghostship.mp4',	0),
(189,	47,	'Overwhelming odds',	'Turns the enemies\' numbers against them, dealing damage and granting you bonus movement speed per unit or per hero.  Deals bonus damage to illusions and summoned units as a percent of their current health.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/legion_commander_overwhelming_odds.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/legion_commander/legion_commander_overwhelming_odds.mp4',	1),
(190,	47,	'Press the attack',	'Removes debuffs and disables from the target friendly unit, and grants bonus attack speed and health regen for a short time.\r\n\r\nDISPEL TYPE: Strong Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/legion_commander_press_the_attack.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/legion_commander/legion_commander_press_the_attack.mp4',	2),
(191,	47,	'Moment of courage',	'When attacked, Legion Commander has a chance to immediately counterattack with bonus lifesteal.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/legion_commander_moment_of_courage.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/legion_commander/legion_commander_moment_of_courage.mp4',	3),
