(204,	50,	'Infest',	'Lifestealer infests the body of a target unit, becoming undetectable, and healing for a portion of his max hitpoints every second while inside. He can then explode from the host body, dealing damage to nearby enemies. If the infested unit is an enemy creep or a neutral creep, he can take control of the unit\'s ability to move and attack. Does not work on enemy heroes.\r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/life_stealer_infest.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/life_stealer/life_stealer_infest.mp4',	0),
