(245,	61,	'Boundless strike',	'Monkey King enlarges his staff and slams it against the ground, stunning enemies in a line and damaging them with a critical hit based on his attack. Has True Strike.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/monkey_king_boundless_strike.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/monkey_king/monkey_king_boundless_strike.mp4',	1),
(246,	61,	'Tree dance',	'Monkey King jumps to a tree and perches atop it. While perched, he gains the Primal Spring ability-a channeled leap attack. If Monkey King\'s tree is destroyed, he falls and is stunned for 4 seconds. Taking damage from player controlled units or Roshan while on the ground puts Tree Dance on cooldown.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/monkey_king_tree_dance.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/monkey_king/monkey_king_tree_dance.mp4',	2),
(247,	61,	'Jingu mastery',	'Monkey King\'s attacks awaken the Jingu Bang\'s power. Upon the fourth hit on the same enemy hero, Monkey King earns four charged attacks that have bonus damage and lifesteal.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/monkey_king_jingu_mastery.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/monkey_king/monkey_king_jingu_mastery.mp4',	3),
(248,	61,	'Wukong\'s command',	'Monkey King creates a circular formation of soldiers that spread out from his position. If Monkey King leaves the area his soldiers disperse. The soldiers have Monkey King\'s attack and only target heroes. Monkey King is granted bonus armor for the spell\'s duration.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/monkey_king_wukongs_command.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/monkey_king/monkey_king_wukongs_command.mp4',	0),
(249,	62,	'Waveform',	'Morphling dissolves into liquid and surges forward, damaging enemy units in his path.  Morphling is invulnerable during Waveform.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/morphling_waveform.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/morphling/morphling_waveform.mp4',	1),
(250,	62,	'Adaptive strike (agility)',	'Launches a surge of water toward an enemy unit, dealing base damage plus additional damage based on Morphling\'s agility times a multiplier.  If Morphling\'s agility is 50% higher than strength, the maximum agility multiplier is used. \r\n\r\n Also puts Adaptive Strike (Strength) on a 3.0 second cooldown.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/morphling_adaptive_strike_agi.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/morphling/morphling_adaptive_strike_agi.mp4',	2),
(251,	62,	'Adaptive strike (strength)',	'Launches a surge of water toward an enemy unit, stunning and knocking back the target based on Morphling\'s strength. If his strength is 50% higher than his agility, the maximum stun/knockback is dealt. \r\n\r\n Also puts Adaptive Strike (Agility) on a 3.0 second cooldown.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/morphling_adaptive_strike_str.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/morphling/morphling_adaptive_strike_str.mp4',	2),
(252,	62,	'Attribute shift (agility gain)',	'Morphling shifts its form, pulling points from Strength and pouring them into Agility. The process is reversible.  Additional points in Attribute Shift increase the rate of stat change.  Passively grants bonus Agility.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/morphling_morph_agi.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/morphling/morphling_morph_agi.mp4',	3),
(253,	62,	'Attribute shift (strength gain)',	'Morphling shifts its form, pulling points from Agility and pouring them into Strength. The process is reversible.  Additional points in Attribute Shift increase the rate of stat change.  Passively grants bonus Strength.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/morphling_morph_str.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/morphling/morphling_morph_str.mp4',	3),
(254,	62,	'Morph',	'Morphling changes his form to match the targeted enemy, gaining their basic abilities with reduced mana cost. Can be toggled for the duration of the ability.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/morphling_replicate.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/morphling/morphling_replicate.mp4',	0),
(255,	63,	'Mirror image',	'Creates multiple images of Naga Siren under her control.\r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/naga_siren_mirror_image.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/naga_siren/naga_siren_mirror_image.mp4',	1),
(256,	63,	'Ensnare',	'Interrupts the target and traps them in place, preventing movement or blinking.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/naga_siren_ensnare.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/naga_siren/naga_siren_ensnare.mp4',	2),
(257,	63,	'Rip tide',	'The Naga Siren and her images have a chance on attack to hit all nearby units with a damaging wave of water that lowers armor for 4.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/naga_siren_rip_tide.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/naga_siren/naga_siren_rip_tide.mp4',	3),
(258,	63,	'Song of the siren',	'All enemies in range of the Naga Siren are put into a magical stasis where they cannot act or be attacked. Using Song of the Siren again will end the duration early.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/naga_siren_song_of_the_siren.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/naga_siren/naga_siren_song_of_the_siren.mp4',	0),
(259,	64,	'Sprout',	'Sprouts a ring of trees around a unit, trapping it in place, and providing vision in a 500 radius.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/furion_sprout.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/furion/furion_sprout.mp4',	1),
(260,	64,	'Teleportation',	'Teleports to any point on the map.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/furion_teleportation.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/furion/furion_teleportation.mp4',	2),
(261,	64,	'Nature\'s call',	'Converts an area of trees into Treants under the command of Nature\'s Prophet.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/furion_force_of_nature.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/furion/furion_force_of_nature.mp4',	3),
(262,	64,	'Wrath of nature',	'Damaging energy bounces around the map, striking enemies close to the cast point that are in vision. Each enemy hit beyond the first adds damage. Enemies that die under this spell grant you bonus damage for 50.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/furion_wrath_of_nature.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/furion/furion_wrath_of_nature.mp4',	0),
(263,	65,	'Death pulse',	'Necrophos releases a wave of death around him, dealing damage to enemy units and healing allied units.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/necrolyte_death_pulse.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/necrolyte/necrolyte_death_pulse.mp4',	1),
(264,	65,	'Ghost shroud',	'Necrophos slips into the realm that separates the living from the dead. Unable to attack or be attacked, he emits an aura that slows enemies around him. He takes additional magic damage in this form, but his restorative powers are amplified.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/necrolyte_sadist.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/necrolyte/necrolyte_sadist.mp4',	2),
(265,	65,	'Heartstopper aura',	'Necrophos stills the hearts of his opponents, causing nearby enemy units to lose a percentage of their max health over time. Passively provides regen for 8.0 seconds for each unit Necrophos kills.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/necrolyte_heartstopper_aura.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/necrolyte/necrolyte_heartstopper_aura.mp4',	3),
(266,	65,	'Reaper\'s scythe',	'Stuns the target enemy hero, then deals damage based on how much life it is missing. Heroes killed by Reaper\'s Scythe will have 15 seconds added to their respawn timer. Any kill under this effect is credited to Necrophos.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/necrolyte_reapers_scythe.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/necrolyte/necrolyte_reapers_scythe.mp4',	0),
(267,	66,	'Void',	'Creates a damaging void that slows an enemy unit and deals damage.  Void also mini-stuns, interrupting channeling abilities. The slowing effect lasts longer at night.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/night_stalker_void.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/night_stalker/night_stalker_void.mp4',	1),
(268,	66,	'Crippling fear',	'Night Stalker horrifies all nearby enemies, causing them to become silenced while near him.  The effect lasts longer at night.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/night_stalker_crippling_fear.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/night_stalker/night_stalker_crippling_fear.mp4',	2),
(269,	66,	'Hunter in the night',	'Night Stalker is in his element at night, attacking and moving with great swiftness.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/night_stalker_hunter_in_the_night.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/night_stalker/night_stalker_hunter_in_the_night.mp4',	3),
(270,	66,	'Dark ascension',	'Night Stalker smothers the sun and summons instant darkness, so that he might use his powers at their fullest. Nightstalker gains flight and bonus damage during this time. Has unobstructed vision.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/night_stalker_darkness.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/night_stalker/night_stalker_darkness.mp4',	0),
(271,	67,	'Impale',	'Rock spikes burst from the earth along a straight path. Enemy units are hurled into the air, then are stunned and take damage when they fall.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/nyx_assassin_impale.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/nyx_assassin/nyx_assassin_impale.mp4',	1),
(272,	67,	'Mana burn',	'Destroys the target hero\'s mana equal to a multiplier of its Intelligence, and deals damage equal to the mana burned.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/nyx_assassin_mana_burn.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/nyx_assassin/nyx_assassin_mana_burn.mp4',	2),
(273,	67,	'Spiked carapace',	'When activated while above ground, Spiked Carapace reflects and negates damage dealt to Nyx Assassin (max once from each source), as well as stunning the source of the damage. Activating Spiked Carapace will not break Vendetta invisibility.\r\n\r\nWhile Burrowed, Spiked Carapace instantly stuns nearby enemies when cast.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/nyx_assassin_spiked_carapace.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/nyx_assassin/nyx_assassin_spiked_carapace.mp4',	3),
(274,	67,	'Vendetta',	'Allows Nyx Assassin to become invisible and gain a speed bonus.  If Nyx Assassin attacks to break the invisibility, massive bonus damage is dealt with the attack.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/nyx_assassin_vendetta.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/nyx_assassin/nyx_assassin_vendetta.mp4',	0),
(275,	68,	'Fireblast',	'Blasts an enemy unit with a wave of fire, dealing damage and stunning the target.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ogre_magi_fireblast.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ogre_magi/ogre_magi_fireblast.mp4',	1),
(276,	68,	'Ignite',	'Drenches the target and another random unit in volatile chemicals, causing it to burst into flames. The target is in immense pain, taking damage and moving more slowly.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ogre_magi_ignite.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ogre_magi/ogre_magi_ignite.mp4',	2),
(277,	68,	'Bloodlust',	'Incites a frenzy in a friendly unit, increasing its movement speed and attack speed. Gives bonus attacks speed if cast on Ogre himself. Can be cast on towers.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ogre_magi_bloodlust.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ogre_magi/ogre_magi_bloodlust.mp4',	3),
(278,	68,	'Multicast',	'Enables Ogre Magi to cast his abilities and items multiple times with each use.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ogre_magi_multicast.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ogre_magi/ogre_magi_multicast.mp4',	0),
(279,	69,	'Purification',	'Instantly heals a friendly unit and damages all nearby enemy units.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/omniknight_purification.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/omniknight/omniknight_purification.mp4',	1),
(280,	69,	'Heavenly grace',	'Creates a divine barrier around an ally which grants them increased Status Resistance, Strength and Health Regeneration.\r\n\r\nDISPEL TYPE: Strong Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/omniknight_repel.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/omniknight/omniknight_repel.mp4',	2),
(281,	69,	'Degen aura',	'Greatly degenerates the movement capabilities of enemy units that stray too near.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/omniknight_degen_aura.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/omniknight/omniknight_degen_aura.mp4',	3),
(282,	69,	'Guardian angel',	'Omniknight calls upon a Guardian Angel that grants allies immunity from physical damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/omniknight_guardian_angel.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/omniknight/omniknight_guardian_angel.mp4',	0),
(283,	70,	'Fortune\'s end',	'CHANNELED - Gathers Oracle\'s power into a bolt of scouring energy that, when released, damages, roots, and purges enemies of buffs in an area around the target. If target is an ally it will only purge debuffs. The root duration is equal to the time spent channeling.\r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/oracle_fortunes_end.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/oracle/oracle_fortunes_end.mp4',	1),
(284,	70,	'Fate\'s edict',	'Oracle enraptures a target, disarming them and granting them 100% magic damage resistance. Can be cast on allies and enemies.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/oracle_fates_edict.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/oracle/oracle_fates_edict.mp4',	2),
(285,	70,	'Purifying flames',	'Burns away impurities, dealing heavy magic damage to the target before causing them to regenerate health over time. The amount of health regenerated over its duration exceeds the amount of initial damage. Can be cast on enemies and allies.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/oracle_purifying_flames.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/oracle/oracle_purifying_flames.mp4',	3),
(286,	70,	'False promise',	'Temporarily alters an ally\'s destiny, delaying any healing or damage taken until False Promise ends. Any healing that is delayed by False Promise is doubled. Removes most negative status effects and disables on initial cast.\r\n\r\nDISPEL TYPE: Strong Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/oracle_false_promise.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/oracle/oracle_false_promise.mp4',	0),
(287,	71,	'Arcane orb',	'Adds extra pure damage to Outworld Destroyer\'s attacks, based on his remaining mana pool.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/obsidian_destroyer_arcane_orb.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/obsidian_destroyer/obsidian_destroyer_arcane_orb.mp4',	1),
(288,	71,	'Astral imprisonment',	'Places a target unit into an astral prison. The hidden unit is invulnerable and disabled. When the astral prison implodes, it deals damage to the target and steals a percentage of their max mana.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/obsidian_destroyer_astral_imprisonment.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/obsidian_destroyer/obsidian_destroyer_astral_imprisonment.mp4',	2),
(289,	71,	'Essence flux',	'Passively grants you a chance to restore a percentage of your max mana each time you cast an ability.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/obsidian_destroyer_equilibrium.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/obsidian_destroyer/obsidian_destroyer_equilibrium.mp4',	3),
(290,	71,	'Sanity\'s eclipse',	'Unleashes a psychic blast that deals to enemies based on the difference between your mana and the target\'s mana. Sanity\'s Eclipse can hit units trapped by Astral Imprisonment.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/obsidian_destroyer_sanity_eclipse.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/obsidian_destroyer/obsidian_destroyer_sanity_eclipse.mp4',	0),
(291,	72,	'Swashbuckle',	'Vector Targeted. Pangolier dashes along the target line, then slashes all enemies in the drawn direction with several quick swipes.\r\n\r\nLucky Shot has a chance to activate from this damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pangolier_swashbuckle.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pangolier/pangolier_swashbuckle.mp4',	1),
(292,	72,	'Shield crash',	'Pangolier jumps in the air and slams back to the ground in front of his current position, damaging all enemies in a radius. For each enemy hero hit, he gains a percentage of incoming damage reduction for a short time.\r\n\r\nForward movement is maintained if Shield Crash is used while Rolling Thunder is active, and allows Rolling Thunder to clear walls or cliffs.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pangolier_shield_crash.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pangolier/pangolier_shield_crash.mp4',	2),
(293,	72,	'Lucky shot',	'Pangolier rolls the dice and lets fate decide the outcome for his enemies. Grants a chance to slow, apply a Disarm and reduce armor.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pangolier_lucky_shot.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pangolier/pangolier_lucky_shot.mp4',	3),
(294,	72,	'Rolling thunder',	'Pangolier curls into a spell-immune ball and rolls out. When rolling, he moves at an increased speed and can move through trees, but has a decreased ability to turn. Striking enemies knocks them back, inflicting damage and stunning them when they land. \r\n\r\nColliding with walls or cliffs will cause a temporary pause while Pangolier reverses in direction.\r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pangolier_gyroshell.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pangolier/pangolier_gyroshell.mp4',	0),
(295,	73,	'Stifling dagger',	'Throws a dagger slowing the enemy unit\'s movement speed, dealing 65+25% of Phantom Assassin\'s attack damage as physical damage and applying attack effects from items and abilities.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phantom_assassin_stifling_dagger.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phantom_assassin/phantom_assassin_stifling_dagger.mp4',	1),
(296,	73,	'Phantom strike',	'Teleports to a unit, friendly or enemy, and grants bonus attack speed while attacking if it\'s an enemy unit.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phantom_assassin_phantom_strike.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phantom_assassin/phantom_assassin_phantom_strike.mp4',	2),
(297,	73,	'Blur',	'Phantom Assassin focuses inward, increasing her ability to evade enemy attacks. Can be activated to blur her body, causing her to be impossible to see until near enemy heroes.\r\n\r\nStacks diminishingly with other sources of Evasion.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phantom_assassin_blur.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phantom_assassin/phantom_assassin_blur.mp4',	3),
(298,	73,	'Coup de grace',	'Phantom Assassin refines her combat abilities, gaining a chance of delivering a devastating critical strike to enemy units. Stifling Dagger shares the same critical strike chance.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phantom_assassin_coup_de_grace.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phantom_assassin/phantom_assassin_coup_de_grace.mp4',	0),
(299,	74,	'Spirit lance',	'Sends a magical spirit lance to a target enemy unit that damages and slows, while summoning an illusory phantom to attack the unit.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phantom_lancer_spirit_lance.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phantom_lancer/phantom_lancer_spirit_lance.mp4',	1),
(300,	74,	'Doppelganger',	'Phantom Lancer briefly vanishes from the battlefield. After 1.0 second, Phantom Lancer and any of his nearby illusions reappear at a random position within the targeted location, along with two additional doppelgangers. Extends duration of all illusions. The two added doppelgangers have different properties: one takes normal damage and deals none, while the other takes 500% bonus damage and deals -80% less damage.\r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phantom_lancer_doppelwalk.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phantom_lancer/phantom_lancer_doppelwalk.mp4',	2),
(301,	74,	'Phantom rush',	'When targetting an enemy for an attack, Phantom Lancer quickly charges into range, gaining a temporary agility boost. Phantom Lancer\'s illusions also have this ability.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phantom_lancer_phantom_edge.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phantom_lancer/phantom_lancer_phantom_edge.mp4',	3),
(302,	74,	'Juxtapose',	'Phantom Lancer has a chance to fracture his presence, creating an illusion of himself. Illusions also have a chance to fracture further. Illusions created from Phantom Lancer last for 8 seconds, while illusions created from other illusions last 4 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phantom_lancer_juxtapose.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phantom_lancer/phantom_lancer_juxtapose.mp4',	0),
(303,	75,	'Icarus dive',	'Phoenix dives forward in an arc with a fixed distance in the targeted direction, dealing damage over time and slowing the movement speed of any units it comes into contact with, and then orbiting back to its original position. If Phoenix casts Supernova, the dive ends.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phoenix_icarus_dive.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phoenix/phoenix_icarus_dive.mp4',	1),
(304,	75,	'Fire spirits',	'Summons 4 fire spirits that circle around Phoenix. Each spirit can be launched independently at a targeted area of effect. Affected enemy units take damage over time and have their attack speed greatly reduced.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phoenix_fire_spirits.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phoenix/phoenix_fire_spirits.mp4',	2),
(305,	75,	'Sun ray',	'Phoenix expels a beam of light at the cost of its own health. The beam damages enemies and heals allies for a base amount plus a percentage of their health. The percentage increases as the beam continues to fire.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phoenix_sun_ray.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phoenix/phoenix_sun_ray.mp4',	3),
(306,	75,	'Supernova',	'The Phoenix willingly ends its current life for the chance to be reborn. Transforms into a burning sun that scorches enemies in a huge area. The sun can be destroyed by attacks from enemy Heroes. After 6.0 seconds the sun explodes, stunning all nearby enemies while restoring Phoenix to full health and mana with refreshed abilities.\r\n\r\nDISPEL TYPE: Strong Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/phoenix_supernova.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/phoenix/phoenix_supernova.mp4',	0),
(307,	76,	'Illusory orb',	'Puck launches a magic orb that floats in a straight path, damaging enemy units along the way. At any point, Puck may teleport to the orb\'s location using Ethereal Jaunt.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/puck_illusory_orb.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/puck/puck_illusory_orb.mp4',	1),
(308,	76,	'Waning rift',	'Puck teleports to the target location and releases a burst of faerie dust that deals damage and silences enemy units nearby.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/puck_waning_rift.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/puck/puck_waning_rift.mp4',	2),
(309,	76,	'Phase shift',	'CHANNELED - Puck briefly shifts into another dimension where it is immune from harm.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/puck_phase_shift.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/puck/puck_phase_shift.mp4',	3),
(310,	76,	'Dream coil',	'Creates a coil of volatile magic that latches onto enemy Heroes, stunning them for 0.5 seconds, damaging and leashing them.  If the enemy hero stretches the coil by moving too far away, it snaps, stunning and dealing additional damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/puck_dream_coil.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/puck/puck_dream_coil.mp4',	0),
(311,	77,	'Meat hook',	'Launches a bloody hook toward a unit or location. The hook will snag the first unit it encounters, dragging the unit back to Pudge and dealing damage if it is an enemy.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pudge_meat_hook.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pudge/pudge_meat_hook.mp4',	1),
(312,	77,	'Rot',	'A toxic cloud that deals intense damage and slows movement--harming not only enemy units but Pudge himself.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pudge_rot.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pudge/pudge_rot.mp4',	2),
(313,	77,	'Flesh heap',	'Gives Pudge increased magic resistance, as well as bonus strength that increases each time Pudge kills an enemy Hero or it dies in his vicinity.  Flesh Heap is retroactive, meaning it can gain charges before it is skilled, which then become active.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pudge_flesh_heap.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pudge/pudge_flesh_heap.mp4',	3),
(314,	77,	'Dismember',	'CHANNELED - Pudge chows down on an enemy unit, disabling it and dealing damage over time. Pudge gets healed for the same amount he damages. Lasts longer on creeps.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pudge_dismember.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pudge/pudge_dismember.mp4',	0),
(315,	78,	'Nether blast',	'An exploding pulse deals damage to enemies and structures in the area.  Deals half damage to structures.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pugna_nether_blast.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pugna/pugna_nether_blast.mp4',	1),
(316,	78,	'Decrepify',	'A powerful banishing spell that slows a unit and renders it unable to attack or be attacked. Afflicted units take extra magic damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pugna_decrepify.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pugna/pugna_decrepify.mp4',	2),
(317,	78,	'Nether ward',	'Pugna places a Nether Ward at the target location. The ward causes nearby enemy heroes to lose a percentage of their max mana every second, and will fire at any enemy hero who casts a spell. Nether Ward deals base damage plus the damage multiplier of the mana spent by the enemy hero.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pugna_nether_ward.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pugna/pugna_nether_ward.mp4',	3),
(318,	78,	'Life drain',	'CHANNELED - When cast on an enemy, Pugna drains health from the target enemy unit to heal himself and granting vision over the target. If Pugna has full HP, and the enemy target is a Hero, Life Drain will restore mana instead.\r\n\r\nWhen cast on an ally, Pugna will drain his own health into his ally.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/pugna_life_drain.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/pugna/pugna_life_drain.mp4',	0),
(319,	79,	'Shadow strike',	'Hurls a poisoned dagger which deals large initial damage, and then deals damage over time. The poisoned unit has its movement speed slowed for 15.0 seconds.  An instance of damage is dealt every 3.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/queenofpain_shadow_strike.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/queenofpain/queenofpain_shadow_strike.mp4',	1),
(320,	79,	'Blink',	'Short distance teleportation that allows Queen of Pain to move in and out of combat.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/queenofpain_blink.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/queenofpain/queenofpain_blink.mp4',	2),
