(323,	80,	'Plasma field',	'Releases a wave of energetic plasma that grows in power as it expands, but also zaps on contraction, slowing and dealing damage to enemy units caught in its path. Damage and slow increases with distance from Razor. The Plasma Field hits each unit twice, once each direction.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/razor_plasma_field.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/razor/razor_plasma_field.mp4',	1),
(324,	80,	'Static link',	'Creates a charged link between Razor and an enemy Hero, stealing damage from the target and giving it to Razor. Allows razor to attack while moving with the link active.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/razor_static_link.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/razor/razor_static_link.mp4',	2),
(325,	80,	'Storm surge',	'Passively increases Razor\'s movement speed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/razor_unstable_current.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/razor/razor_unstable_current.mp4',	3),
(326,	80,	'Eye of the storm',	'A powerful lightning storm strikes out at enemy units with the lowest health, dealing damage and reducing their armor.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/razor_eye_of_the_storm.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/razor/razor_eye_of_the_storm.mp4',	0),
(327,	81,	'Smoke screen',	'Throws down a smoke bomb, silencing enemies, and causing them to miss attacks.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/riki_smoke_screen.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/riki/riki_smoke_screen.mp4',	1),
(328,	81,	'Blink strike',	'Teleports behind the target unit, striking for bonus damage if it is an enemy.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/riki_blink_strike.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/riki/riki_blink_strike.mp4',	2),
(329,	81,	'Tricks of the trade',	'Riki phases out of the world while striking random enemy units from behind in an area around him.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/riki_tricks_of_the_trade.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/riki/riki_tricks_of_the_trade.mp4',	3),
(330,	81,	'Cloak and dagger',	'Riki fades into the shadows, becoming invisible. Every time Riki strikes his enemy from behind, he deals bonus damage based on his Agility. When Riki attacks, he becomes visible.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/riki_backstab.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/riki/riki_backstab.mp4',	0),
(331,	82,	'Telekinesis',	'Rubick uses his telekinetic powers to lift the enemy into the air briefly and then hurls them back at the ground. The unit lands on the ground with such force that it stuns nearby enemies.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/rubick_telekinesis.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/rubick/rubick_telekinesis.mp4',	1),
(332,	82,	'Fade bolt',	'Rubick creates a powerful stream of arcane energy that travels between enemy units, dealing damage and reducing their attack damage. Each jump deals less damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/rubick_fade_bolt.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/rubick/rubick_fade_bolt.mp4',	2),
(333,	82,	'Arcane supremacy',	'Rubick\'s mastery of the arcane allows him to have a larger cast range and increased potency.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/rubick_arcane_supremacy.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/rubick/rubick_arcane_supremacy.mp4',	3),
(334,	82,	'Spell steal',	'Rubick studies the trace magical essence of one enemy hero, learning the secrets of the last spell the hero cast. Rubick can use this spell as his own for several minutes or until he dies, and stolen spells last longer on enemies.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/rubick_spell_steal.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/rubick/rubick_spell_steal.mp4',	0),
(335,	83,	'Burrowstrike',	'Sand King burrows into the ground and tunnels forward, damaging and stunning enemy units above him as he resurfaces.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/sandking_burrowstrike.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/sand_king/sandking_burrowstrike.mp4',	1),
(336,	83,	'Sand storm',	'Sand King creates a fearsome sandstorm that damages enemy units while hiding him from vision.  The effect ends when Sand King leaves the area.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/sandking_sand_storm.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/sand_king/sandking_sand_storm.mp4',	2),
(337,	83,	'Caustic finale',	'Sand King\'s attacks inject a venom that causes enemy units to move more slowly and to violently explode when it dies.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/sandking_caustic_finale.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/sand_king/sandking_caustic_finale.mp4',	3),
(338,	83,	'Epicenter',	'CHANNELED - After channeling for %abilitychanneltime% seconds, Sand King sends a disturbance into the earth, causing it to shudder violently. All enemies caught within range will take damage and become slowed. Each subsequent pulse increases the radius of damage dealt.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/sandking_epicenter.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/sand_king/sandking_epicenter.mp4',	0),
(339,	84,	'Disruption',	'Banishes the targeted unit from the battlefield for a short duration.  Upon returning, two illusions of the banished unit are created under Shadow Demon\'s control.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shadow_demon_disruption.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shadow_demon/shadow_demon_disruption.mp4',	1),
(340,	84,	'Soul catcher',	'Captures the soul of enemy units in an area, causing them to lose a percentage of their current health. When the debuff is removed, the units gain half of the lost health back. Units under the effect of Disruption can still be affected by Soul Catcher.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shadow_demon_soul_catcher.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shadow_demon/shadow_demon_soul_catcher.mp4',	2),
(341,	84,	'Shadow poison',	'Deals damage in a line, and afflicts enemy units with a poison effect. The poison deals 1/2/4/8/16 times the stack damage based on the number of stacks on the target, up to 5 stacks. Additional stacks cause 50.0 damage each.  This deferred damage is dealt when Shadow Poison\'s duration is expired, or the Release sub-ability is used.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shadow_demon_shadow_poison.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shadow_demon/shadow_demon_shadow_poison.mp4',	3),
(342,	84,	'Demonic purge',	'Purges the target enemy unit, removing positive buffs, and slowing the target for the duration.  The unit slowly regains its speed until the end of the duration, upon which damage is dealt.  Units under the effect of Disruption can still be affected by Demonic Purge.\r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shadow_demon_demonic_purge.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shadow_demon/shadow_demon_demonic_purge.mp4',	0),
(343,	85,	'Shadowraze',	'Shadow Fiend razes the ground directly in front of him, dealing damage to enemy units in the area. Adds a stacking damage amplifier on the target that causes the enemy to take bonus Shadow Raze damage per stack.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/nevermore_shadowraze1.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/nevermore/nevermore_shadowraze1.mp4',	1),
(344,	85,	'Necromastery',	'Shadow Fiend steals the soul from units he kills, gaining bonus damage. On death, he releases 40% of them from bondage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/nevermore_necromastery.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/nevermore/nevermore_necromastery.mp4',	2),
(345,	85,	'Presence of the dark lord',	'Shadow Fiend\'s presence reduces the armor of nearby enemies.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/nevermore_dark_lord.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/nevermore/nevermore_dark_lord.mp4',	3),
(346,	85,	'Requiem of souls',	'Shadow Fiend gathers his captured souls to release them as lines of demonic energy. Units near Shadow Fiend when the souls are released can be damaged by several lines of energy. Any unit damaged by Requiem of Souls will be feared and have its movement speed reduced for 0.8 seconds for each line hit. Lines of energy are created for every soul captured through Necromastery. <span><br><span><br> Requiem of Souls is automatically cast whenever Shadow Fiend dies, regardless of its cooldown.</span></span>',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/nevermore_requiem.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/nevermore/nevermore_requiem.mp4',	0),
(347,	86,	'Ether shock',	'Creates a cone of ethereal energy that strikes multiple enemy units.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shadow_shaman_ether_shock.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shadow_shaman/shadow_shaman_ether_shock.mp4',	1),
(348,	86,	'Hex',	'Transforms an enemy unit into a harmless creature, disabling their attacks and abilities.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shadow_shaman_voodoo.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shadow_shaman/shadow_shaman_voodoo.mp4',	2),
(349,	86,	'Shackles',	'CHANNELED - Magically binds an enemy unit so that it cannot move or attack, while dealing damage over time.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shadow_shaman_shackles.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shadow_shaman/shadow_shaman_shackles.mp4',	3),
