(407,	100,	'Anchor smash',	'Tidehunter swings his mighty anchor to attack and deal bonus damage to nearby enemies and reduce their attack damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/tidehunter_anchor_smash.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/tidehunter/tidehunter_anchor_smash.mp4',	3),
(408,	100,	'Ravage',	'Slams the ground, causing tentacles to erupt in all directions, damaging and stunning all nearby enemy units.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/tidehunter_ravage.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/tidehunter/tidehunter_ravage.mp4',	0),
(409,	101,	'Whirling death',	'Timbersaw whirls extremely sharp edges, damaging enemies and destroying trees around him in an area.  If an enemy hero is affected, it loses some of its primary attribute for a short duration.  Whirling Death will deal bonus damage per tree destroyed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shredder_whirling_death.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shredder/shredder_whirling_death.mp4',	1),
(410,	101,	'Timber chain',	'Timbersaw fires a chain that embeds itself in the first tree it hits, pulling him towards it.  Any enemy in the path takes damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shredder_timber_chain.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shredder/shredder_timber_chain.mp4',	2),
(411,	101,	'Reactive armor',	'Each time Timbersaw is attacked, he gains increased health regen and armor.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shredder_reactive_armor.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shredder/shredder_reactive_armor.mp4',	3),
(412,	101,	'Chakram',	'Fires Timbersaw\'s main saw blade at the target location where it will spin in place, dealing damage in an area around it.  Enemies caught in the saw blade will move more slowly for every 5% of health missing. The blade deals damage and cuts down trees in its path when fired and retracted.  While active the ability costs mana, and Timbersaw loses the ability to attack.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/shredder_chakram.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/shredder/shredder_chakram.mp4',	0),
(413,	102,	'Laser',	'Fires an intense energy beam, dealing damage and blinding the target, causing it to miss all physical attacks.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/tinker_laser.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/tinker/tinker_laser.mp4',	1),
(414,	102,	'Heat-seeking missile',	'Launches rockets at the nearest visible enemy heroes within 2500 range.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/tinker_heat_seeking_missile.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/tinker/tinker_heat_seeking_missile.mp4',	2),
(415,	102,	'March of the machines',	'Enlists an army of robotic minions to destroy enemy units in an area around Tinker.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/tinker_march_of_the_machines.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/tinker/tinker_march_of_the_machines.mp4',	3),
(416,	102,	'Rearm',	'CHANNELED - Resets the cooldown on most of Tinker\'s items and abilities.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/tinker_rearm.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/tinker/tinker_rearm.mp4',	0),
