(424,	104,	'Living armor',	'Infuses the target hero or structure with a protective coating which heals the target and provides bonus armor.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/treant_living_armor.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/treant/treant_living_armor.mp4',	3),
(425,	104,	'Nature\'s guise',	'Provides Treant with Tree Walking whenever he hasn\'t taken damage for 3.0 seconds. While active, Treant gains movement speed bonus and amplified healing and regeneration on himself.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/treant_natures_guise.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/treant/treant_natures_guise.mp4',	4),
(426,	104,	'Overgrowth',	'Summons an overgrowth of vines and branches around Treant that deal damage to afflicted enemies and prevent them from moving, blinking, going invisible, or attacking.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/treant_overgrowth.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/treant/treant_overgrowth.mp4',	0),
(427,	105,	'Berserker\'s rage',	'While active, Troll Warlord swaps from using ranged to melee attacks. Melee attacks have a chance to ensnare, preventing the target from moving or using mobility spells. Berserker\'s Rage also grants additional movement speed, armor, and decreases base attack time.\r\n\r\nWhirling Axes has different functionality while Berserker\'s Rage is active.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/troll_warlord_berserkers_rage.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/troll_warlord/troll_warlord_berserkers_rage.mp4',	1),
(428,	105,	'Whirling axes (ranged)',	'Troll hurls a fistful of five axes in a cone shape over 950.0 range, slowing and damaging enemy units.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/troll_warlord_whirling_axes_ranged.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/troll_warlord/troll_warlord_whirling_axes_ranged.mp4',	2),
