(430,	105,	'Fervor',	'With each continuous blow on the same target, Troll gains increased attack speed.  If Troll changes targets, the stacks drop to zero.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/troll_warlord_fervor.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/troll_warlord/troll_warlord_fervor.mp4',	3),
(431,	105,	'Battle trance',	'Troll unleashes a powerful battle trance, that forces you to continuously attack the closest enemy unit within 900 range, prioritizing heroes. Damage does not kill you during this mode. Grants you bonus lifesteal, attack speed and movement speed. Applies a Basic Dispel.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/troll_warlord_battle_trance.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/troll_warlord/troll_warlord_battle_trance.mp4',	0),
(432,	106,	'Ice shards',	'Tusk compresses shards of ice into a ball of frozen energy that damages all enemies it comes in contact with. When the ball reaches its target destination the shards are released, creating a barrier that lasts for 4.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/tusk_ice_shards.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/tusk/tusk_ice_shards.mp4',	1),
(433,	106,	'Snowball',	'Tusk begins rolling into a snowball. Allies within a 350 radius can also be added to the snowball by right-clicking on them, even while the snowball is moving. Once launched, any enemies caught in the snowball\'s path will be stunned and take damage. Each allied Hero in the snowball will add to its damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/tusk_snowball.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/tusk/tusk_snowball.mp4',	2),
(434,	106,	'Tag team',	'Temporarily applies a negative debuff aura around you, causing enemies that are attacked under it to take bonus physical damage and reduced movement speed. Lasts 5.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/tusk_tag_team.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/tusk/tusk_tag_team.mp4',	3),
