(440,	108,	'Decay',	'Undying steals strength from all enemy heroes in an area, dealing base damage as he claims the enemy\'s strength for himself.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/undying_decay.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/undying/undying_decay.mp4',	1),
(441,	108,	'Soul rip',	'Undying rips health away from all nearby units and uses it to heal an ally, or damage an enemy. Soul Rip can also be used to heal Tombstone.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/undying_soul_rip.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/undying/undying_soul_rip.mp4',	2),
(442,	108,	'Tombstone',	'Summons a tombstone at the target point.  Zombies will frequently spawn next to every enemy unit in the area around the Tombstone, and attack them.  Zombies have the Deathlust ability, which causes their attacks to slow the target, and if the target reaches below a certain amount of health, increases the attack and movement speed of the zombie.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/undying_tombstone.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/undying/undying_tombstone.mp4',	3),
(443,	108,	'Flesh golem',	'Undying transforms into a horrifying flesh golem. Gains a percentage increase to strength and imbues attacks with a slow and damage amplification.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/undying_flesh_golem.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/undying/undying_flesh_golem.mp4',	0),
