(445,	109,	'Overpower',	'Using his skill in combat, Ursa gains increased attack speed for a number of subsequent attacks.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ursa_overpower.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ursa/ursa_overpower.mp4',	2),
(446,	109,	'Fury swipes',	'Ursa\'s claws dig deeper wounds in the enemy, causing consecutive attacks to the same enemy to deal more damage.  If the same target is not attacked after 8.0 seconds, the bonus damage is lost.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ursa_fury_swipes.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ursa/ursa_fury_swipes.mp4',	3),
(447,	109,	'Enrage',	'Ursa goes into a frenzy, providing damage reduction and status resistance. Removes any existing debuffs.\r\n\r\nDISPEL TYPE: Strong Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/ursa_enrage.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/ursa/ursa_enrage.mp4',	0),
(448,	110,	'Magic missile',	'Fires a magic missile at an enemy unit, stunning and dealing damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/vengefulspirit_magic_missile.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/vengefulspirit/vengefulspirit_magic_missile.mp4',	1),
(449,	110,	'Wave of terror',	'Vengeful Spirit lets loose a wicked cry, weakening the armor of enemies and giving vision of the path ahead.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/vengefulspirit_wave_of_terror.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/vengefulspirit/vengefulspirit_wave_of_terror.mp4',	2),
