(452,	111,	'Venomous gale',	'Launches a ball of venom in a line, poisoning enemy units so that they take both initial damage and damage over time, as well as suffering slowed movement.  Venomous Gale deals damage every 3 seconds over its duration.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/venomancer_venomous_gale.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/venomancer/venomancer_venomous_gale.mp4',	1),
(453,	111,	'Poison sting',	'Adds poison damage to Venomancer\'s normal attacks and slowing movement speed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/venomancer_poison_sting.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/venomancer/venomancer_poison_sting.mp4',	2),
(454,	111,	'Plague ward',	'Summons a plague ward to attack enemy units and structures. The ward is immune to magic. Wards gain the Poison Sting level from Venomancer, dealing 50% of the full damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/venomancer_plague_ward.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/venomancer/venomancer_plague_ward.mp4',	3),
(455,	111,	'Poison nova',	'A spreading ring of poison that does damage over time to enemy units around Venomancer.  Poison Nova cannot deal lethal damage; targets will be left with at least 1 health.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/venomancer_poison_nova.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/venomancer/venomancer_poison_nova.mp4',	0),
(456,	112,	'Poison attack',	'Intensifies Viper\'s venom, adding an effect to his normal attack that applies a stacking movement speed slow and magic resistance deduction while dealing damage over time. Stacks up to 5 times.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/viper_poison_attack.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/viper/viper_poison_attack.mp4',	1),
(457,	112,	'Nethertoxin',	'Viper releases a Nethertoxin at the targeted area. Units in that area take an increasing damage over time based on how long they remain in it. Disables passives of affected units.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/viper_nethertoxin.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/viper/viper_nethertoxin.mp4',	2),
