(459,	112,	'Viper strike',	'Viper slows the targeted enemy unit\'s movement and attack speed while also dealing poison damage over time.  The slowing effect reduces over the duration of the poison.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/viper_viper_strike.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/viper/viper_viper_strike.mp4',	0),
(460,	113,	'Grave chill',	'Visage drains the movement and attack speed of the targeted unit, gaining it for itself.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/visage_grave_chill.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/visage/visage_grave_chill.mp4',	1),
(461,	113,	'Soul assumption',	'Visage gathers charges of soul essence each time nearby heroes take more than 100 damage. When the essence is released, it deals base damage as well as damage for each gathered soul charge.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/visage_soul_assumption.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/visage/visage_soul_assumption.mp4',	2),
(462,	113,	'Gravekeeper\'s cloak',	'Visage generates a layered barrier that protects him from damage.  If he receives damage from a player, one layer is removed, and takes time to recover.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/visage_gravekeepers_cloak.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/visage/visage_gravekeepers_cloak.mp4',	3),
(463,	113,	'Summon familiars',	'Conjures two blind Familiars to fight for Visage.  Familiars possess the Stone Form ability, that allows them to turn into stone, stunning enemies upon landing.  While in Stone Form, Familiars are invulnerable, and rapidly regenerate their health.  Familiars grant high bounty when killed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/visage_summon_familiars.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/visage/visage_summon_familiars.mp4',	0),
(464,	114,	'Aether remnant',	'Vector targeted. Void Spirit dispatches a remnant to the target location. The remnant stands watch over the region, facing the direction of his vector. When a unit crosses its gaze, the remnant pulls it in and damages it.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/void_spirit_aether_remnant.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/void_spirit/void_spirit_aether_remnant.mp4',	1),
(465,	114,	'Dissimilate',	'Void Spirit temporarily fades into the aether, creating a number of portals through which he can reassemble himself. Upon exiting a portal, he damages all enemies in the area.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/void_spirit_dissimilate.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/void_spirit/void_spirit_dissimilate.mp4',	2),
(466,	114,	'Resonant pulse',	'Void Spirit wraps himself in a protective shield that absorbs physical damage and emits a single damaging pulse around him. The shield gains increased damage absorption for each enemy hero the pulse hits.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/void_spirit_resonant_pulse.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/void_spirit/void_spirit_resonant_pulse.mp4',	3),
(467,	114,	'Astral step',	'Void Spirit tears a rift through the astral plane to appear at the target location, attacking all enemies along the path. This attack inflicts a void mark that slows for 1.3 seconds and then detonates.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/void_spirit_astral_step.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/void_spirit/void_spirit_astral_step.mp4',	0),
(468,	115,	'Fatal bonds',	'Binds several enemy units together, causing a percentage of the damage dealt to one of them to be felt by the others.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/warlock_fatal_bonds.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/warlock/warlock_fatal_bonds.mp4',	1),
(469,	115,	'Shadow word',	'Warlock whispers an incantation, healing a friendly unit or damaging an enemy unit over time.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/warlock_shadow_word.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/warlock/warlock_shadow_word.mp4',	2),
(470,	115,	'Upheaval',	'CHANNELED - A powerful slowing current that grows stronger as it\'s channelled. Lasts up to 10.0 seconds.  Enemies are slowed for 3.0 seconds after leaving the area or the spell ends.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/warlock_upheaval.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/warlock/warlock_upheaval.mp4',	3),
(471,	115,	'Chaotic offering',	'Summons a Golem from the depths, stunning enemies for one second. The Golem lives 60.0 seconds, takes reduced damage from spells, has Permanent Immolation and Flaming Fists on attack.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/warlock_rain_of_chaos.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/warlock/warlock_rain_of_chaos.mp4',	0),
(472,	116,	'The swarm',	'Weaver launches a swarm of 12 young Weavers that latch on any enemy unit in their path, attacking and reducing armor until it is killed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/weaver_the_swarm.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/weaver/weaver_the_swarm.mp4',	1),
(473,	116,	'Shukuchi',	'Weaver shifts out of visibility, gaining max movement speed --doing harm to any enemies it passes through.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/weaver_shukuchi.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/weaver/weaver_shukuchi.mp4',	2),
(474,	116,	'Geminate attack',	'Allows Weaver to dispatch two attacks at once.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/weaver_geminate_attack.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/weaver/weaver_geminate_attack.mp4',	3),
(475,	116,	'Time lapse',	'Weaver warps backward to whatever position it was in five seconds earlier--regaining the HP and mana from that time. No effect on cooldown, gold or experience.\r\n\r\nDISPEL TYPE: Strong Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/weaver_time_lapse.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/weaver/weaver_time_lapse.mp4',	0),
(476,	117,	'Shackleshot',	'Shackles the target to an enemy unit or tree in a line directly behind it.  If no unit or tree is present, the stun duration is reduced to 0.8.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/windrunner_shackleshot.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/windrunner/windrunner_shackleshot.mp4',	1),
(477,	117,	'Powershot',	'Windranger charges her bow for up to 1.0 second for a single powerful shot, which deals more damage the longer it is charged. The arrow damages enemies along its path. For each enemy that Powershot hits, its damage is reduced by 20%.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/windrunner_powershot.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/windrunner/windrunner_powershot.mp4',	2),
(478,	117,	'Windrun',	'Increases movement speed and adds evasion from all physical attacks, while slowing movement of nearby enemies.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/windrunner_windrun.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/windrunner/windrunner_windrun.mp4',	3),
(479,	117,	'Focus fire',	'Windranger channels the wind to gain 475 additional attack speed against a single enemy unit or structure, though with a reduction to her attack damage.  Extra damage from secondary item effects is not reduced.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/windrunner_focusfire.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/windrunner/windrunner_focusfire.mp4',	0),
(480,	118,	'Arctic burn',	'Winter Wyvern soars upon an arctic wind, granting her unobstructed movement and allowing her to exhale a blistering chill into each attack. While soaring, her attacks travel further and faster, and slow enemies with a magical freeze that strips them of 6.0% of their current health each second. Her sight is also hardened against night\'s chill, granting her 400 additional vision range at night while soaring.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/winter_wyvern_arctic_burn.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/winter_wyvern/winter_wyvern_arctic_burn.mp4',	1),
(481,	118,	'Splinter blast',	'Launches a ball of brittle ice toward an enemy. The ice shatters on impact, leaving the primary target completely unaffected, while hurling damaging splinters into nearby enemies in a 500 radius. Enemies struck by these splinters are slowed by 30%.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/winter_wyvern_splinter_blast.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/winter_wyvern/winter_wyvern_splinter_blast.mp4',	2),
(482,	118,	'Cold embrace',	'Encases an ally in an icy cocoon, freezing them solid while healing a base amount as well as a percentage of their maximum health each second. The cocoon blocks all physical damage.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/winter_wyvern_cold_embrace.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/winter_wyvern/winter_wyvern_cold_embrace.mp4',	3),
(483,	118,	'Winter\'s curse',	'Winter Wyvern freezes an enemy in place while striking those nearby with a maddening curse which causes them to attack their frozen ally with increased attack speed. The frozen ally and those cursed to attack their ally are immune to all damage from their enemies with the exception of Winter Wyvern or her controlled units.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/winter_wyvern_winters_curse.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/winter_wyvern/winter_wyvern_winters_curse.mp4',	0),
(484,	119,	'Paralyzing cask',	'Launches a cask of paralyzing powder that ricochets between enemy units, stunning and damaging those it hits.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/witch_doctor_paralyzing_cask.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/witch_doctor/witch_doctor_paralyzing_cask.mp4',	1),
(485,	119,	'Voodoo restoration',	'Witch Doctor focuses his magic to heal nearby allied units, costing Witch Doctor mana every second Voodoo restoration is active.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/witch_doctor_voodoo_restoration.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/witch_doctor/witch_doctor_voodoo_restoration.mp4',	2),
(486,	119,	'Maledict',	'Curses all enemy Heroes in a small area, causing them to take a set amount of damage each second, as well as bursts of damage every 4 seconds based on how much health they have lost since the curse began.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/witch_doctor_maledict.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/witch_doctor/witch_doctor_maledict.mp4',	3),
(487,	119,	'Death ward',	'CHANNELED - Summons a deadly ward to attack enemy heroes within it\'s attack range. Lasts a maximum of 8.0 seconds.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/witch_doctor_death_ward.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/witch_doctor/witch_doctor_death_ward.mp4',	0),
(488,	120,	'Wraithfire blast',	'Wraith King sears an enemy unit with spectral fire, dealing damage and stunning, then dealing damage over time and slowing the target.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/skeleton_king_hellfire_blast.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/skeleton_king/skeleton_king_hellfire_blast.mp4',	1),
(489,	120,	'Vampiric spirit',	'Restore health based on the damage Wraith King deals when attacking enemy units. Can be cast to summon skeletons with Vampiric Spirit. Every two kills on an enemy unit adds a skeleton charge. Skeletons respawn once when killed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/skeleton_king_vampiric_aura.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/skeleton_king/skeleton_king_vampiric_aura.mp4',	2),
(490,	120,	'Mortal strike',	'Wraith King passively deals bonus damage on an attack with a cooldown.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/skeleton_king_mortal_strike.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/skeleton_king/skeleton_king_mortal_strike.mp4',	3),
(491,	120,	'Reincarnation',	'Wraith King\'s form regroups after death, allowing him to resurrect when killed in battle.  Upon death, enemy units in a 900 radius will be slowed.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/skeleton_king_reincarnation.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/skeleton_king/skeleton_king_reincarnation.mp4',	0),
(492,	121,	'Arc lightning',	'Hurls a bolt of lightning that leaps through nearby enemy units.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/zuus_arc_lightning.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/zuus/zuus_arc_lightning.mp4',	1),
(493,	121,	'Lightning bolt',	'Calls down a bolt of lightning to strike an enemy unit, causing damage and a mini-stun. When cast, Lightning Bolt briefly provides unobstructed vision and True Sight around the target in a 750 radius. Can be cast on the ground, affecting the closest enemy hero in 325 range.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/zuus_lightning_bolt.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/zuus/zuus_lightning_bolt.mp4',	2),
(494,	121,	'Static field',	'Zeus shocks any enemy hit by his abilities, causing damage proportional to their current health.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/zuus_static_field.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/zuus/zuus_static_field.mp4',	3),
(495,	121,	'Thundergod\'s wrath',	'Strikes all enemy heroes with a bolt of lightning, no matter where they may be.  Thundergod\'s Wrath also provides True Sight around each hero struck.  If an enemy hero is invisible, it takes no damage, but the True Sight is still created at that hero\'s location.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/zuus_thundergods_wrath.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/zuus/zuus_thundergods_wrath.mp4',	0),
(496,	41,	'Cold Snap',	'Invoker draws the heat from an enemy, chilling them to their very core for a duration based on the level of Quas. The enemy will take damage and be briefly frozen. Further damage taken in this state will freeze the enemy again, dealing bonus damage. The enemy can only be frozen so often, but the freeze cooldown decreases based on the level of Quas.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_cold_snap.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_cold_snap.mp4',	4),
(497,	41,	'Ghost Walk',	'Invoker manipulates the ice and electrical energies around him, rendering his body invisible. The elemental imbalance created as a consequence slows nearby enemies based on the level of Quas, and slows Invoker as well based on the level of Wex.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_ghost_walk.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_ghost_walk.mp4',	5),
(498,	41,	'Tornado',	'Unleashes a fast moving tornado that picks up enemy units in its path, suspending them helplessly in the air shortly before allowing them to plummet to their doom. Travels further based on the level of Wex. Holds enemies in the air for a duration based on the level of Quas. Deals base damage plus added damage based on levels in Wex.\r\n\r\nDISPEL TYPE: Basic Dispel',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_tornado.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_tornado.mp4',	6),
(499,	41,	'E.M.P',	'Invoker builds up a charge of electromagnetic energy at a targeted location which automatically detonates after 2.9 seconds. The detonation covers an area, draining mana based on the level of Wex. Deals damage for each point of mana drained.  If EMP drains mana from an enemy hero, Invoker gains 50% of the mana drained.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_emp.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_emp.mp4',	7),
(500,	41,	'Alacrity',	'Invoker infuses an ally with an immense surge of energy, increasing their attack speed based on the level of Wex and their damage based on the level of Exort.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_alacrity.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_alacrity.mp4',	8),
(501,	41,	'Chaos Meteor',	'Invoker pulls a flaming meteor from space onto the targeted location. Upon landing, the meteor rolls forward, constantly dealing damage based on the level of Exort, and rolling further based on the level of Wex. Units hit by the meteor will also be set on fire for a short time, receiving additional damage based on the level of Exort.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_chaos_meteor.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_chaos_meteor.mp4',	9),
(502,	41,	'Sun Strike',	'Sends a catastrophic ray of fierce energy from the sun at any targeted location, incinerating all enemies standing beneath it once it reaches the earth. Deals damage based on the level of Exort, however this damage is spread evenly over all enemies hit.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_sun_strike.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_sun_strike.mp4',	10),
(503,	41,	'Forge Spirit',	'Invoker forges a spirit embodying the strength of fire and fortitude of ice. Damage and armor are based on the level of Exort while attack range, health, and duration are based on the level of Quas. The elemental\'s scorching attack is capable of melting the armor of enemy heroes. Spawns two spirits when Quas and Exort are at least level 4.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_forge_spirit.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_forge_spirit.mp4',	11),
(504,	41,	'Ice Wall',	'Generates a wall of solid ice directly in front of Invoker for a duration based on the level of Quas. The bitter cold emanating from it greatly slows nearby enemies based on the level of Quas and deals damage each second based on the level of Exort.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_ice_wall.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_ice_wall.mp4',	12),
(505,	41,	'Deafening Blast',	'Invoker unleashes a mighty sonic wave in front of him, dealing damage to any enemy unit it collides with based on the level of Exort. The sheer impact from the blast is enough to knock those enemy units back for a duration based on the level of Quas, then disarm their attacks for a duration based on the level of Wex.',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/abilities/invoker_deafening_blast.png',	'https://cdn.cloudflare.steamstatic.com/apps/dota2/videos/dota_react/abilities/invoker/invoker_deafening_blast.mp4',	13);
