(160,	'Urn of Shadows',	'urn_of_shadows',	'Contains the ashes of powerful demons.',	'Heals HP over time for friendly units, and deals damage over time for enemy units. The healing effect is lost if the affected unit takes damage from heroes, hero controlled units or Roshan. Gains a charge every time an enemy hero dies nearby. If the Urn is empty and has no charges, it gains 2 charges instead. Only the closest Urn to the dying hero will gain a charge.',	840,	0,	2,	2,	2,	0,	0,	0,	1.5,	2,	0,	'http://cdn.dota2.com/apps/dota2/images/items/urn_of_shadows_lg.png',	2,	8,	'\"[\\\"150\\\"]\"',	1),
(161,	'Vanguard',	'vanguard',	'A powerful shield that defends its wielder from even the most vicious of attacks.',	'Blocks damage. The amount blocked depends on whether the user is a melee or ranged hero.',	1925,	0,	0,	0,	0,	250,	0,	7,	0,	0,	0,	'http://cdn.dota2.com/apps/dota2/images/items/vanguard_lg.png',	2,	10,	'\"[\\\"38\\\",\\\"1\\\"]\"',	0),
(162,	'Veil of Discord',	'veil_of_discord',	'The headwear of corrupt magi.',	'Emits a weakening blast that amplifies the spell damage enemies take.',	1525,	0,	4,	4,	4,	0,	0,	0,	0,	0,	0,	'http://cdn.dota2.com/apps/dota2/images/items/veil_of_discord_lg.png',	2,	9,	'\"[]\"',	1),
(163,	'Vitality Booster',	'vitality_booster',	'A ruby gemstone that has been passed down through generations of warrior kin.',	'Vitality Booster is an item purchasable from the Secret Shop.',	1100,	0,	0,	0,	0,	250,	0,	0,	0,	0,	0,	'http://cdn.dota2.com/apps/dota2/images/items/vitality_booster_lg.png',	1,	5,	'\"[\\\"72\\\",\\\"3\\\",\\\"150\\\",\\\"161\\\",\\\"148\\\"]\"',	0),
