INSERT INTO `neutral_item` (`id`, `name`, `alias`, `lore`, `description`, `dmgIncrease`, `strIncrease`, `agiIncrease`, `intIncrease`, `hpIncrease`, `mpIncrease`, `hpRegenIncrease`, `mpRegenIncrease`, `armorIncrease`, `msIncrease`, `image`, `tier`) VALUES
(1,	'Arcane Ring',	'arcane_ring',	'Once a prized heirloom of a minor lord\'s house.',	'Arcane Rings are fully sharable.\r\nFor Strength strength heroes, it grants 2 armor, 120 mana and 0.5 mana regen.\r\nFor Agility agility heroes, it grants 2 armor, 120 mana and 0.5 mana regen.\r\nFor Intelligence intelligence heroes, it grants 2 armor, 120 mana, 0.5 mana regen and 10 attack damage.',	NULL,	NULL,	NULL,	'10',	NULL,	NULL,	NULL,	NULL,	'2',	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/arcane_ring_lg.png',	1),
(2,	'Broom Handle',	'broom_handle',	'The surprisingly dangerous creation of an apprentice sorcerer with a strange fondness for brooms.',	'Broom Handles are fully sharable.\r\nStacks with all other attack range bonuses.\r\nAffects the cast range of active attack modifiers as well.',	'14',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'3',	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/broom_handle_lg.png',	1),
(3,	'Chipped Vest',	'chipped_vest',	'It doesn\'t look like much, but it\'s oddly comfy.',	'Everytime you are attacked, you return 30 damage to heroes and 20 damage to creeps.\r\nReturn Damage (Heroes): 30\r\nReturn Damage (Creeps): 20',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'5',	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/chipped_vest_lg.png',	1),
(4,	'Faded Broach',	'faded_broach',	'A life-saving jewel bestowed upon a young queen by a kindly vizier.',	'The Faded Broach is a Tier 1 neutral item dropped by neutral creeps.',	NULL,	NULL,	NULL,	NULL,	NULL,	'200',	NULL,	NULL,	NULL,	'20',	'http://cdn.dota2.com/apps/dota2/images/items/faded_broach_lg.png',	1),
(5,	'Fairy\'s Trinket',	'fairys_trinket',	'A small token imbued with the fortune of the fae in recognition of an intriguing display of mortal kindness.',	'Fairy\'s Trinkets are fully sharable.\r\nThe mana loss reduction stacks additively with other sources of mana loss reduction.',	NULL,	NULL,	NULL,	NULL,	'100',	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/fairys_trinket_lg.png',	1),
(6,	'Ironwood Tree',	'ironwood_tree',	'Precious. And hearty as a weed.',	'Ironwood Trees are fully sharable.\r\nFor Strength heroes, it grants 120 health, 0.6 health regen, 1 armor, 6 attack speed, 72 mana, 0.3 mana regen and 6 attack damage.\r\nFor Agility heroes, it grants 120 health, 0.6 health regen, 1 armor, 6 attack speed, 72 mana, 0.3 mana regen and 6 attack damage.\r\nFor Intelligence heroes, it grants 120 health, 0.6 health regen, 1 armor, 6 attack speed, 72 mana, 0.3 mana regen and 6 attack damage.',	NULL,	'6',	'6',	'6',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/ironwood_tree_lg.png',	1),
(7,	'Keen Optic',	'keen_optic',	'Stolen from a tinker\'s shop ages ago, this handy lens has seen service to many owners.',	'The Keen Optic is a Tier 1 neutral item dropped by neutral creeps.',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'1.25',	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/keen_optic_lg.png',	1),
(8,	'Ocean Heart',	'ocean_heart',	'A charm blessed by the Council of the Brine.',	'Ocean Hearts are fully sharable.\r\nFor Strength heroes, it grants 100 health, 0.5 health regen, 0.83 armor, 5 attack speed, 60 mana, 0.25 mana regen and 5 attack damage.\r\nFor Agility heroes, it grants 100 health, 0.5 health regen, 0.83 armor, 5 attack speed, 60 mana, 0.25 mana regen and 5 attack damage.\r\nFor Intelligence heroes, it grants 100 health, 0.5 health regen, 0.83 armor, 5 attack speed, 60 mana, 0.25 mana regen and 5 attack damage. Provides you with 10 HP regen and 5 mana regen while in the river.\r\nRiver Health Regen Bonus: 10\r\nRiver Mana Regen Bonus: 5',	NULL,	'5',	'5',	'5',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/ocean_heart_lg.png',	1),
(9,	'Possessed Mask',	'possessed_mask',	'Even when discarded with specific purpose and great care, this frightening mask always finds its way onto the face of a new owner.',	'Possessed Masks are fully sharable.\r\nFor Strength heroes, it grants 140 health, 0.7 health regen, and 7 attack damage.\r\nFor Agility heroes, it grants 1.17 armor, 7 attack speed, and 7 attack damage.\r\nFor Intelligence heroes, it grants 84 mana, 0.35 mana regen, and 7 attack damage. Heals the attacker for 7% of attack damage dealt\r\nLifesteal: 7%\r\nCannot be used by illusions. Lifesteal particles are visible on illusions, but they do not gain health from their attacks.',	NULL,	'7',	'7',	'7',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/possessed_mask_lg.png',	1),
(10,	'Trusty Shovel',	'trusty_shovel',	'Former plaything of a young deity, received as a gift from his uncle.',	'Channel for 1 second.\r\nCan find a Bounty Rune, a Flask, an Enchanted Mango, or an enemy Kobold.\r\nChannel Time: 1\r\nBounty Rune Drop Chance: 16%\r\nHealing Salve Drop Chance: 28%\r\nEnchanted Mango Drop Chance: 28%\r\nKobold Drop Chance: 28%',	NULL,	NULL,	NULL,	NULL,	'100',	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/trusty_shovel_lg.png',	1),
(11,	'Bullwhip',	'bullwhip',	'Once the favored lash of an infamous broker of pit fighters and other live trade.',	'Grants 18% movement speed when cast on allies, and slows by 18% when cast on enemies. Lasts 4 seconds.\r\nCast Range: 850\r\nMove Speed Change: 18%\r\nDuration: 4',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'3',	'2.5',	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/bullwhip_lg.png',	2),
(12,	'Dragon Scale',	'dragon_scale',	'The remains of a dragon always outvalue the wealth of even the most prodigious hoard.',	'Causes attacks to burn the enemy, dealing 18 damage per second for 3 seconds.\r\nAffects buildings.\r\nDamage per Second: 18\r\nDuration: 3',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'5',	NULL,	'5',	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/dragon_scale_lg.png',	2),
(13,	'Essence Ring',	'essence_ring',	'An ancient bauble blessed by the breath of Verodicia.',	'Increases your current and maximum health by 400 for 15 seconds.\r\nHealth Bonus: 400\r\nDuration: 15',	NULL,	NULL,	NULL,	'6',	NULL,	NULL,	NULL,	'2.5',	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/essence_ring_lg.png',	2),
(14,	'Grove Bow',	'grove_bow',	'A gift from the moon goddess to one of her prized disciples many memories ago.',	'Reduces magic resistance of the attacked enemy by 15%.\r\nMagic Resistance Reduction: 15%\r\nDuration: 6',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/grove_bow_lg.png',	2),
(15,	'Imp Claw',	'imp_claw',	'Though their tasks are largely thankless, demon hunters can often turn a profit bartering parts in Weeping Rose.',	'Empowers your next attack, causing it to be a critical strike dealing 130% damage.\r\nCritical Damage: 130%',	'26',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/imp_claw_lg.png',	2),
(16,	'Nether Shawl',	'nether_shawl',	'An otherworldly garment tethered to our plane by unknown means.',	'Increases most heroes\' total magic resistance to 43.75%, assuming basic 25% magic resistance and no other sources of magic resistance.',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'-3',	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/nether_shawl_lg.png',	2),
(17,	'Philosopher\'s Stone',	'philosophers_stone',	'A weightless charm created by an enchanter with a powerful scorn for brute force.',	'Philosopher\'s Stones are fully sharable.\r\nThe gold gained is reliable gold.\r\nThe passive gold gain works while dead as well.\r\nIllusions and clones cannot utilize the passive gold gain.',	'-30',	NULL,	NULL,	NULL,	NULL,	'200',	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/philosophers_stone_lg.png',	2),
(18,	'Pupil\'s Gift',	'pupils_gift',	'An astounding plate of ever-replenishing, fortifying fruit.',	'Pupil\'s Gifts are fully sharable.\r\nOnly increases the hero\'s secondary attributes. The primary attribute is not increased.\r\nFor Strength heroes, it grants 2.33 armor, 14 attack speed, 168 mana, and 0.7 mana regen.\r\nFor Agility heroes, it grants 280 health, 1.4 health regen, 168 mana, and 0.7 mana regen.\r\nFor Intelligence heroes, it grants 280 health, 1.4 health regen, 2.33 armor, and 14 attack speed.',	NULL,	'14',	'14',	'14',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/pupils_gift_lg.png',	2),
(19,	'Quicksilver Amulet',	'quicksilver_amulet',	'An enchanted talisman brimming with a mysterious substance.',	'Grants you a bonus 4% movement speed and 20 attack speed anytime one of your abilities are on cooldown.\r\nMove Speed Bonus: 4%\r\nAttack Speed Bonus: 20',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'4%',	'http://cdn.dota2.com/apps/dota2/images/items/quicksilver_amulet_lg.png',	2),
(20,	'Ring of Aquila',	'ring_of_aquila',	'The ring of the fallen Warlord Aquila continues to support armies in battle.',	'Rings of Aquila are fully sharable.\r\nFor Strength heroes, it grants 60 health, 0.3 health regen, 1.5 armor, 9 attack speed, 36 mana, 0.15 mana regen and 10 attack damage.\r\nFor Agility heroes, it grants 60 health, 0.3 health regen, 1.5 armor, 9 attack speed, 36 mana, 0.15 mana regen and 16 attack damage.\r\nFor Intelligence heroes, it grants 60 health, 0.3 health regen, 1.5 armor, 9 attack speed, 36 mana, 0.15 mana regen and 10 attack damage. Grants 1.25 mana regeneration and 2 armor to nearby allies.\r\n\r\nDeactivate to stop affecting non-hero units.\r\nRadius: 1200\r\nMana Regeneration Bonus: 1.25\r\nArmor Bonus: 2\r\nAura Linger Duration: 0.5',	'7',	'3',	'9',	'3',	NULL,	NULL,	NULL,	'1.25',	'2',	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/ring_of_aquila_lg.png',	2),
(21,	'Ceremonial Robe',	'ceremonial_robe',	'One of many items lost in the looting of Zelenwyr\'s sacred reliquary.',	'Lowers enemy Status Resistance by 10% and Magic Resistance by 10%.\r\nRadius: 1200\r\nStatus Resistance Reduction: 10%\r\nMagic Resistance Reduction: 10%\r\nAura Linger Duration: 0.5',	NULL,	NULL,	NULL,	NULL,	NULL,	'350',	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/ceremonial_robe_lg.png',	3),
(22,	'Cloak of Flames',	'cloak_of_flames',	'A very fine cloak that plays host to an overly-protective living flame.',	'Burns enemy units for damage per second. Illusions deal damage per second.\r\nRadius: 375\r\nDamage per Second (Hero): 45\r\nDamage per Second (Illusion): 30\r\nAura Linger Duration: 0.5',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'4',	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/cloak_of_flames_lg.png',	3),
(23,	'Elven Tunic',	'elven_tunic',	'Even simple items of elven make it seem imbued with inexplicable efficacy.',	'Elven Tunics are fully sharable.\r\nThe evasion stacks diminishingly with other sources of evasion.\r\nThe evasion uses pseudo-random distribution.',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'7%',	'http://cdn.dota2.com/apps/dota2/images/items/elven_tunic_lg.png',	3),
(24,	'Enchanted Quiver',	'enchanted_quiver',	'A graceful gift blessed by the goddess of the hunt.',	'Empowers your next attack with 300 bonus magical damage and True Strike. Ranged Attackers have +400 bonus range for the attack.\r\nAttack Range Bonus: 400\r\nDamage: 300',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/enchanted_quiver_lg.png',	3),
(25,	'Mind Breaker',	'mind_breaker',	'A bewitching blade of indeterminate form capable of piercing the psyche of even the most willful foe.',	'The next attack silences the hit enemy for 1.75 seconds.\r\nDuration: 1.75',	'25',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/mind_breaker_lg.png',	3),
(26,	'Orb of Destruction',	'orb_of_destruction',	'An ingot of chaos suspended in wizard\'s ether, housed within an arcanist\'s orb.',	'Attacks reduce the target\'s armor and movement speed. Slow amount varies based on whether the wearer is melee or ranged.\r\nMove Speed Slow (Melee): 25%\r\nMove Speed Slow (Ranged): 15%\r\nArmor Reduction: 4\r\nDuration: 4',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/orb_of_destruction_lg.png',	3),
(27,	'Paladin Sword',	'paladin_sword',	'The sigil blade of the legendary Brother Yhols of Gausra, stripped from its scabbard on the day of his controversial excommunication.',	'Amplifies the wearer\'s Regeneration, Healing, Lifesteal and Spell Lifesteal by 14%.\r\nHeal Amplification: 14%',	'20',	NULL,	NULL,	NULL,	NULL,	NULL,	'14%',	NULL,	NULL,	NULL,	'http://cdn.dota2.com/apps/dota2/images/items/paladin_sword_lg.png',	3),
